INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('3csystem','3C Systems buySecure solution is first and foremost the link between a Manufacturer, its uniquely identified Product and the unique Consumer that purchases it, establishing an interactive two-way communication between them, before and after purchase.\nbuySecure:\n protects each product from counterfeiting\n ensures control  where and to whom each product is sold, until it reaches the store and the consumer\n provides a global solution, fully integrated with GS1 standards\n ensures Manufacturers autonomy in deciding where and how to print and apply the codes and to manage in real time the individual codes content in any language','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/3CSystem.png','3C System','ISV','http://www.3csystem.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('abacus','Abacus Valuers Limited are leading retail stocktaking and auditing specialists with over 25 years experience. With experienced staff located in 16 regional teams, we operate throughout the UK, the Republic of Ireland and increasingly in mainland Europe, including a working partnership with a leading German stocktaking and inventory company.  We pride ourselves on providing clients with the highest levels of service that meet their individual needs. In addition to our stocktaking services, we supply a range of innovative bar code scanning and label printing systems, based on customised software packages we have developed which draw on our practical experience.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/abacus-valuers.png','Abacus Valuers','ISV','http://www.abacusvaluers.co.uk ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('accesscontrol','ACT was established in 1995. ACT specialises in the design and manufacture of superior quality electronic Access Control and Door Entry products. The ACT product portfolio has a functionality that is effective and well developed in line with the demands of the market. ACTcloud services is a new division of ACT focusing on the design and development of user friendly, professional work force management services including visitor management and time & attendance solutions.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/act-cloud.png','Access Control Technology','ISV','http://www.accesscontrol.ie',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('accessvia','AccessVia designs and deploys cost-cutting solutions for shelf-edge signs, labels, digital signs and electronic shelf labels (ESLs). Our systems are in use daily at over 60,000 locations worldwide including Target, Best Buy, Staples, Walgreens, and Kroger. The AccessVia Publishing Platform seamlessly delivers print or digital promotions to stores for immediate availability or to central print service providers for high-speed production. Stores can re-print from centrally produced batches. The same system produces digital signs and ESLs - ensuring consistency across all touchpoints. Get the right content and price, at the right location and time, tailored for execution efficiency -- regardless of the publishing method. Print anywhere with AccessVia.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/accessvia.png','AccessVia','ISV','http://www.accessvia.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('acqua','Presente no mercado nacional e internacional, a Acqua Manager est h mais de 10 anos no Brasil como uma empresa focada em desenvolvimento e comercializao de solues para o mercado vertical de concesses de gua, esgoto e resduos slidos.\nAtualmente, atende a mais de 60% das concessionrias privadas brasileiras, posicionando-se como a melhor provedora de tecnologia da informao do segmento. Gerencia aproximadamente 25 milhes de contas ao ano e movimenta um faturamento superior a R$ 2 bilhes de reais a seus clientes.Nossos escritrios esto localizados em So Paulo, Rio de Janeiro e Lisboa (Portugal), onde investimos constantemente na melhoria dos nossos produtos e servios, buscando inovaes e apoiando o desenvolvimento dos nossos profissionais dia a dia.A empresa pertence ao Fundo de Investimentos e Participaes Houston Trust.Present in national and international markets, Acqua Manager is over 10 years in Brazil as a company focused on developing and marketing solutions for vertical market of concessions of water, sewer and solid waste.  Currently serves over 60% of the Brazilian private concessionaires, positioning itself as the best provider of information technology of this segment. Managing approximately 25 million of bills per year and moving revenues of more than $ 2 billion dollars to its customers.Our offices are located in So Paulo, Rio de Janeiro and Lisbon (Portugal), where we constantly investing to improve our products and services, looking for innovations and supporting the development of our team, everyday.The company belongs to the Fundo de Investimentos e Participaes Houston Trust (Investiment Funds and Holdings Houston Trust).       ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/acqua.png','Acqua Manager','ISV','http://www.acquamanager.com ',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('adc','Applied Data Corporation (ADC) specializes in the development of data-management solutions for the supermarket, grocery and fresh-food industries. The InterScale scales management software, developed by ADC, is a global technology leader for host management of supermarket barcode-labeling scales. The InterScale system is a member of ADC\'s InterStore.NET suite of fresh applications which also includes: NutriGen recipe management and P-Cubed shrink management, fresh inventory management, food production planning and ordering. InterStore.NET consolidates ADC\'s lead in the Fresh Item Management (FIM) software market with an integrated fresh software suite to provide greater efficiencies and optimize production in the grocer\'s fresh-food departments.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/adc.png','ADC','ISV','http://www.applieddatacorp.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('adusa','ADUSA, headquartered in the suburbs of Chicago is a leading provider of self-service solutions to a growing number of retailers in the Supermarket, Convenience Store, and Foodservice industries. Over the years, ADUSA has developed relationships with major kiosk hardware manufacturers that helped it ensure that its systems would be deployed on the most robust hardware and equipment available. ADUSA has also continually improved its own development, deployment, and support processes with the objective of providing retailers with solutions that are functionally effective and always available for their customers to use.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/adusa.png','ADUSA','ISV','http://www.adusainc.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('aimtec','Aimtec is a technological and consultancy company. We focus on implementation of the largest and most popular software products available on the global information technology market. We offer solutions for ERP, WMS, EDI and APS.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/aimtec.png','Aimtec','ISV','http://www.aimtec.cz',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('aldata','Aldata is a global leader in retail and distribution optimization. Our software and service solutions help retailers, distributors and manufacturers dramatically improve their business performance. We optimize categories, space, supply, logistics, and consumer engagement to increase our customers revenue and margins, reduce time, cost and waste, and enhance on-shelf availability, service, and retention. Founded in 1988, Aldata has an unparalleled track record of delivering successful projects for the worlds largest retail and consumer brands, national wholesale and distribution organizations, and regional store chains.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/aldata.png','Aldata','ISV','http://www.aldata-solution.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('allonmobile','AllOnMobile is a revolutionary new way of mobile enabling back office systems. AllOnMobile can take information from any back-office system and display it on a mobile device to streamline tasks such as invoicing, time tracking, dispatching and work order management. Users have access to over 20 field types to generate and record information including data capture such as photos, videos, signatures and QR Codes/Barcodes. AllOnMobile has pre-built integration into the TomTom Business Telematics solution, WEBFLEET to provide a comprehensive in the field mobile solution.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/aom.png','All On Mobile','ISV','http://www.allonmobile.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('alwaysnow','AlwaysNow(r) Studios\' software engineers and digital artists produce and develop software as a service (Saas) that integrates hardware devices running multiple operating systems, including Android, iOS, and Zebra printers. Applications and interfaces created for clients serve both industrial and entertainment purposes.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/alwaysnow.png','AlwaysNow','ISV','http://www.alwaysnow.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('antares','Pharmaceutical industry. A one-stop-shop approach includes software, hardware and full design, deployment and validation services. The inspectors include the full range of controls on the packaging lines, as well as syringes, capsule and tablet inspection machines.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/antares.png','Antares Vision','ISV','http://www.antaresvision.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('appear','Appear is a mobile software specialist with expertise in context-aware application infrastructure, enterprise mobile solutions and consumer location-based services. Appear\'s flagship product, Appear IQ, is a mobile enterprise application platform (MEAP) used to mobilize field service applications. Appear IQ focuses on cost savings and customer service improvements by optimizing mobile workflows and making business critical mobile applications available to employees in real time on their mobile devices. Leading organizations such as MTR Stockholm Subway and Netherlands Railway have chosen the Appear IQ platform due to its compelling ROI, its proven reliability/adaptability in large scale deployments, and the possibility to extend its reach to consumer applications. Appear pioneered the field of context-aware software ten years ago. Our vision is to leverage user context in order to ensure mobile users have exactly the information they need, when and where they need it. Appear is constantly innovating around areas such as human-machine interfaces, machine-to-machine communication, context-aware computing and cross-platform mobile infrastructure, in order to deliver a software infrastructure able to support the next generation of smart devices and smart objects.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/appear.png','Appear Networks','ISV','http://www.appearnetworks.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('applied','Applied Data Corporation (ADC) specializes in the development of data-management solutions for the supermarket, grocery and fresh-food industries. The InterScale scales management software, developed by ADC, is a global technology leader for host management of supermarket barcode-labeling scales. The InterScale system is a member of ADC\'s InterStore.NET suite of fresh applications which also includes: NutriGen recipe management and P-Cubed shrink management, fresh inventory management, food production planning and ordering. InterStore.NET consolidates ADC\'s lead in the Fresh Item Management (FIM) software market with an integrated fresh software suite to provide greater efficiencies and optimize production in the grocer\'s fresh-food departments. For more information, please visit www.AppliedDataCorp.com or www.InterStore.Net','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/adc.png','Applied Data Corporation','ISV','http://www.applieddatacorp.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('aptmobility','aptMobilitys team includes Silicon Valley professionals with years of development and customer facing experience. We also have extended resources around the world that together know the enterprise marketplace and how to quickly implement needed enterprise solutions. We recognize that it is not enough to simply convert existing business processes into mobile apps. That is why we develop Mobile App Strategies for enterprises. We help customers frame their entire business in the context of mobile technology before defining and formulating an appropriate Mobile App Strategy and a Mobile Roadmap for future development. We analyze your business, IT processes, and existing systems and then identify how mobility can liberate your enterprise and unlock latent potential to result in better customer engagement, higher productivity, and higher profits.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/apt.png','AptMobility','ISV','http://www.aptmobility.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('architext','Architext, Inc. is a custom font, bar code and logo/signature digitization developer headquartered out of San Antonio, Texas. Over the past 25 years Architext has become North Americas leading provider of prescription warning label fonts and graphics within the pharmacy market. Architext has always considered itself very fortunate that during their tenure they have established and maintained strong partnerships with other industry leaders such as Zebra and it is these partnerships along with Architexts high standards of quality, customer service and product innovation that have allowed their organization to become known as the \"go to\" company for all custom font, bar code and digitization requirements.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/architext.png','Architext','ISV','http://www.architext.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('asapsystems','ASAP Systems is a global supplier of inventory and asset management software with barcode and RFID solutions that streamline the automated data collection and tracking of assets, items and inventory to some of the world\'s premier enterprises. From integrated platform solutions, to single-user systems that deliver fast ROI, ASAP Systems helps companies support business strategies for increasing revenue, reducing costs and creating competitive advantage.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/asapsystems.png','ASAP Systems','ISV','http://www.asapsystems.com',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('assetsmart','AssetSmart by PMSC is a leading provider of smart asset management software offering Property Professionals true enterprise level asset tracking for over 30 years. SMART|AMIIX mobile work management module has a history of success working with zebra printers. SMART|AMIIX Mobile Tracking System is a fully integrated barcode solution that enables you to automate the collection of inventory and utilization data as well as perform field transactions such as asset receipts, shipments, moves, warehouse checkouts and returns. AssetSmart is a COTS asset management solution provider with a fully integrated portfolio of software solutions.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/assetsmart.png','AssetSmart','ISV','http://www.assetsmart.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('astranueva','Astra Nuevas Tecnologas is a Spanish software development company, specializing in POS, mobile POS, Sales Force Automation, Warehouse Management Systems, and ERP for small and medium business. Our solutions includes technologies such as automatic inbound labelling, traceability, mobile printing and other improvements which permit to our customers to obtain better results, improve efficiency, reduce costs and become more productive.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/astra.png','Astra Nueva Tecnologias ','ISV','http://www.astra.es',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('at4wireless','AT4 wireless offers a range of software solutions based on wireless and mobile communication technologies (RFID, Wi-Fi, Bluetooth, 2G, 3G, WiMAx, LTE and ZigBee) or others (Datamatrix), to enable automation of processes relating to the management and inventory of people and assets. We provide product and Turnkey solutions mainly focused on agri-food, retail, healthcare and logistics and distribution industries . Applications include localization, identification, drugs traceability, patients control, surgical and medical equipment traceability, management, inspection and assets tracking. AT4 wireless is active in EMEA and LATAM markets.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/at4.png','AT4 Wireless','ISV','ttp://www.at4wireless.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('axelot','AxELOT specializes in the automation of management and accounting activities based on 1C:Enterprise platform. The company provides automation services to medium and large businesses in Warehouse and Transportation Logistics, Materials and supplies, Management of financial activities and reports, and Master Data management.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/axelot.png','Axelot-Project','ISV','http://www.axelot.ru/eng',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('borda','Borda Technology provides products and solutions focusing on RFID applications. The company has software and hardware development capabilities as well as delivering turnkey solutions to its customers. Our RFID integrated ERP (Enterprise Resource Planning) software platform combined with our Telemetry products provides seamless visibility into multiple industries including healthcare, pharmaceuticals and cargo. Borda Technology, with its experience on passive and active RFID based locationing and analysis solution for Healthcare institutions brings the ability to track assets, patients and personnel by using the standard based infrastructure.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/borda.png','Borda Teknoloji Arastirma Gelistirme','ISV','http://www.borda.com.tr',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('business2any','Conception & edition of Distributed Artificial Intelligence (DAI) software in the field of the \'Internet of Things\'.  Business2Any was the first to introduce the \'cyberobject\' concept (illustrated by embedded or cloud-hosted intelligent software AVATARS, associated with physical objects) which help to dynamically and contextually control and run businesses whatever the context: uncertainty, chaos, open value chains... Thin-Track is using such AVATARS to support in/outdoor geo-localization, able to work without (expensive) hardware solutions (tags, antennas...). It basically provides real-time alerts / information on asset flows and continuous inventory management... but it can also be easily extended with many other additional features.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/business2any.png','Business2any','ISV','http://www.business2any.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('cap','CAP Software develops powerful, easy to use retail POS solutions for small and medium retailers in a wide variety of verticals such as liquor and beverage, gift shops, apparel boutiques, hardware, sporting goods, pool supply stores, nurseries, jewelry, and more. CAP products are ideal for single stores or chains, including a powerful HQ module. CAP\'s POS interface is intuitive and is backed up by a robust reporting and management toolbar to keep retailers on top of their stores. CAP\'s reseller program gives our partners the products, tools, and support that they need to succeed.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/capsoftware.png','Cap Software','ISV','http://www.capretail.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('capitaltechnology','Capital Technology Solutions is a technology consulting company, software provider, and support center. Our flagship software product is DispatchFuel.com, an electronic ticketing and financial settlement system for trucking companies hauling petroleum or chemical/fluid products. In addition, CTS builds custom software solutions. CTS provides helpdesk and system maintenance/monitoring service contracts for various businesses, as well as outsource clerical, logistical, and scheduling services. At its core, CTS is a technology company providing years of experience to its customers to optimize business performance through technology. CTS also offers all of its products and services to government entities as well as private sector businesses.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/capitaltechnologysolutions.png','Capital Technology Solutions, LLC','ISV','http://www.CapitalTechnologySolutions.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('cardpresso','CardPresso Lda. is a specialty software development company specialized in ID Card solutions, comprising a highly qualified and dedicated team with more than 15 years of experience and a successful track record in relevant fields. The company is focused on bringing to market novel software for the ID branch as well as Project/Custom development and Windows Driver development. CardPresso ID Software is the ultimate Multi-Platform  Windows and MacOS  solution for your professional card design, print and encoding in a user friendly way, connect to databases (ODBC) and take advantage of advanced encoding features like barcode 1D/2D, magnetic stripe, smartcard and RFID such as Mifare, 125Khz technologies, UHF and many more.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/cardpresso.png','Cardpresso','ISV','http://www.cardpresso.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('centrategy','A printed label, tag, receipt, or list is a visible aspect of your productivity application and the printer is an important part of the total solution requiring detailed design and integration.  Centrategy provides expert printing solutions for Zebra printers, covering all phases of printing application design, development, integration, and support. You can rely on our expert knowledge of Zebra printers to design your formats, merge your data with the formats, communicate wired or wirelessly with printers to print your formats, as well as monitor and report critical printer parameters.  Count on Centrategy to deliver quality solutions for your printing requirements.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/centrategy.png','Centrategy','ISV','http://www.centrategy.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('chimera','Chimera Solutions (Represented by ABMAK QATAR) is specialized in delivering a wide range of technology turnkey solutions. With strong strategic partnerships such as the tie up with Zebra & Motorola Solutions, Chimera Solutions has built a reputable name in the hospitality technology, government, retail / supply chain, healthcare verticals and in many other niche markets. The ability of offering dedicated value added services and commitment in making each project an ongoing success has made Chimera Solutions the provider of choice for many of the most renowned companies in the middle east.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/chimera.png','Chimera Solutions','ISV','http://www.chimerasol.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('clockworkit','Clockwork IT Ltd are a forward thinking software development company operating in the field of mobile technology. Established for 10 years, headquartered in Warwick, Clockwork has steadily increased its portfolio of clients and services using a personal style that builds a lasting relationship. With a can do attitude to development, Clockworks clients have benefitted from Clockwork developing and delivering the niche product that has enabled them to do business better. SDMobile is a PDA/Tablet solution for all field based staff, allowing the exchange of real time information between field and office, maximising capacity and efficiency. Key benefits include increasing efficiency through known travel time and navigation, reduction in mileage, travel costs and carbon footprint, improved communication, and real time changes to schedules.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/clockworkit.png','Clockwork IT','ISV','http://www.supportdeskpro.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('cmsoftlutions','CM SoftLutions is a company specialized in providing cost-effective Software Solutions As a Service. Our cloud computing platform (CMSoftonline) enables organizations to easily adopt our solutions to reduce costs and increase productivity by letting you focus on your business so you can achieve your goals faster with the support of our leading-edge technology . Our services include online payment transactions, mobile transactions, online information retrieval, satisfaction measurement and a lot more. For more information please visit our websites www.CMSoftLutions.com - www.CMSoftOnline.com or contact us by mail at info@cmsoftLutions.com  SoftLutions es una compaa especializada en brindar \"Soluciones de Software Como Servicio\": Nuestra plataforma CMSoftOnline permite a las organizaciones contar con soluciones como servicio en la nube (Cloud computing), incrementando la productividad de las compaas centrndose en su negocio, ahorrando costos de manera significativa y alcanzar las metas apoyados por la tecnologa e innovacin de nuestras soluciones. Nuestros Servicios permiten realizar transacciones en lnea, transacciones mviles, consulta de informacin en lnea, mediciones de satisfaccin, entre otras. Para mas informacin lo invitamos a consultar nuestros info@cmsoftLutions.com\n\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/cmsolutions.png','CM Softlutions','ISV','http://www.cmsoftonline.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('collobos','Collobos Software makes mobile printing easy!   Our software Presto turns existing printers into mobile ready for iOS, Android or Chrome OS devices with no additional infrastructure or equipment investment.  Perfect for every business, Presto works wonders in medical, manufacturing, hospitality or any vertical.  If you need to print from your iOS, Android or Chrome OS device, Presto makes it happen.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/collobos.png','Collobos Software ','ISV','ttp://www.collobos.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('com4it','COM4IT is an IT integrator established in 2006 whose core business is software development and integration of complex solutions within the bar code arena - terminals, scanners, and printers into local customer\'s infrastructure. This highly professional company is both a Zebra ISV Partner and Motorola ISV Partner and offers a wealth of experience and technical knowledge to a broad range of customers.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/com4it.png','Com4IT','ISV','http://www.com4it.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('combaseusa','Combase is a developer of point- of-sale and resource management software solutions for the retail, hospitality and attractions industries. Our solutions handle everything from attraction and event ticketing, general and specialty retail, to bars, fast food and restaurants, all in one, platform independent solution that easily scales for facilities of any size. Our mission is to help businesses to optimize their profitability, expand their competitiveness and motivate their workforces by offering innovative and attractive solutions that streamline their day to day workflow with abundant customizations and a painless learning curve.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/combase-usa.png','Combase USA','ISV','http://www.combase-usa.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('commzgate','Commzgate S.A. es especialista en desarrollar e integrar soluciones de captura y transmisin inalmbrica de datos en tiempo real, otorgando un servicio integral que proporciona soluciones de coordinacin mvil de alto valor agregado y soluciones para mbito logstico de RFID , considerando tanto los aspectos tecnolgicos como culturales de sus clientes. Commzgate Latn Amrica opera en la regin hace 9 aos y cuenta con equipo humano de alta especializacin tecnolgica.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/commzgate.png','Commzgate Latin America','ISV','http://www.commzgate-la.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('comunidor','Comunidor S.A. es una compaa integradora de sistemas de radio comunicacin, enfocada en brindar soluciones integrales e innovadoras.  Comercializamos productos de marcas prestigiosas, ofrecemos servicios y aplicaciones diseados  para optimizar la productividad empresarial.  Contamos con aplicaciones de consolas de despacho, gestin de control, geo localizacin que nos permiten agregar valor a nuestros productos.  Trabajamos comprometidos en la elaboracin de soluciones de calidad y respaldamos el servicio con expertos profesionales comprometidos a satisfacer las necesidades de nuestros clientes.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/comunidor.png','COMUNIDOR S.A.','ISV','http://www.comunidor.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('concerntrak','Developed through the collaboration of food safety experts, IT specialists, and experienced business leaders in the food industry, ConcernTrak is a web based tracking system and food safety legislation compliance program. ConcernTrak is an easy to use, affordable and practical solution to the growing \"concern\" surrounding the issue of food safety and compliance. By using ConcernTrak, the food industry can employ a proactive approach to growing calls for government regulation.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/concerntrak.png','Concerntrak','ISV','http://www.concerntrak.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('concise','Concise Mobile, an employee-owned Texas corporation, was founded in 2007 by a group of technologists focused on creating systems for the Direct Store Delivery (DSD) industry. Concise Mobile\'s team members have a long history with a wide range of clients, from \"Mom and Pop\" operations to Fortune 500 companies. Concise Mobile provides reliable, full-featured systems with long life spans. Our automated mobile systems streamline operations, maximize revenue, and help DSD and other companies gain a competitive edge. Most importantly, Concise has created a product that is easy to use and navigate by sales and delivery professionals.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/concise.png','Concise Mobile, Inc.','ISV','http://www.concisemobile.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('config','Established in 1994, The Config Team is a tightly bound unit of 30 highly skilled and innovative SAP Logistics consultants. The successful solutions weve delivered give us a reputation as the leading authority in SAP Logistics implementation. We aim to delight our customers by providing the best tailor made SAP logistics solutions that enable a seamless flow of data through the supply chain.  If theres a way, well find it. If there isnt, well invent it. All we do is based on honesty, integrity and a belief in building trust, because we feel thats the strongest foundation there is for a valued partnership.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/config.png','The Config Team','ISV','http://www.theconfigteam.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('controlservice','Control Service do Brasil Ltda, develop solutions for the 2-way radio business, providing better efficiencies with minimal incremental cost by extending the capabilities of the 2-way radios beyond PTT. Our team has extensive and inimitable combination of experience in radio frequency (RF) and software development. This enables us to develop hardware and software solutions unique in the world markets. Our next generation products will bridge the gap between external real-time data capture devices and any software enterprise solution.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/control.png','Control Service do Brasil Ltda','ISV','\nhttp://www.controlservice.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('cookis','Cook Innovation Solutions Ltd is a business solutions provider operating internationally providing companies with leading edge solutions in the area of individual products authentication (COOK K-CODES) and electronic document management systems (COOK-K-DOCS). Anti-Counterfeiting solution COOK K-CODES is an open solution relevant to all companies looking for a cost efficient and effective solution to give their consumers and customers the guarantee to purchase a genuine product. It has been developed to deliver the lowest possible application cost to manufacturers, through the use of Zebra online printers.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/cook.png','Cook IS','ISV','http://www.cook-is.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('copilot','CoPilot Live Professional from ALK Technologies is a flexible platform of software and services enabling enterprises to deploy integrated, commercial grade turn-by-turn satellite navigation with other line of business applications on rugged devices, tablets or laptops as part of a mobile workforce strategy. Using a mobile devices internal GPS chipset and storing all map data on-board, CoPilot Live Professional optimises performance and reliability while removing any reliance on data downloads for navigation. A truck specific version providing guidance based on vehicle dimensions and load type is also available.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/copilot.png','ALK / CoPilot','ISV','http://www.alk.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('countermind','Countermind\'s Mobile Intelligence(tm) software provides process-centric workflow applications, each customized and packaged with all the necessary support for enterprise-class deployments. With Countermind, all mobile applications in your organization benefit from configurable security, over-the-air data & application management, and a library of standards-based web services for integration. Countermind enables your organization to create a compelling mobile strategy by addressing the complex issues unique to mobile workforces. Applications can be easily tailored to integrate with many business processes, including: Delivery (POD)  ,Field Service, Inspection, Asset Tracking, Healthcare.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/countermind.png','Countermind','ISV','http://www.countermind.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('creative','Creativesystems is a European technological company dedicated to developing integrated solutions for automation and optimization of information flows, supported by expert consulting specialized in innovation, operational management and interactive experiences. A pioneer in the implementation of RFID technology, Creativesystems develops and implements advanced solutions for automatic identification and traceability, with particular application in the retail sector, logistics and manufacturing, nationally and internationally. Established in 2002, the European company is present directly in Portugal, Germany and Brazil and has projects in the U.S., Denmark, Russia and Belgium.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/creativesystems.png','Creative Systems','ISV','http://www.creativesystems.eu',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('crimson','Crimson Tide provides mobile solutions across multiple verticals. Our software is SaaS and is paid on a monthly subscription basis. We have a number of products in the field, with our main offering being www.mpro5.com  allowing users to schedule jobs and paperwork to be completed on any iOS, Android, and Windows Phone / 8 device.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/crimson.png','Crimson Tide','ISV','http://www.crimsontide.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('dasystems','DA Systems is a leading specialist in the provision of 100% fit for purpose mobile data software for the optimisation of field worker productivity in dynamic and complex transport, logistics and field service operational environments.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/dasystems.png','DA Systems','ISV','http://www.da-systems.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('daxo','DAxO operates in the ICT sector with specific focus on Mobile Computing, Wireless & RFID solutions. They provide turnkey RFID solutions for various industries such as MRO (Maintenance Repair and Overhaul), field force automation, automotive, supply chain and manufacturing logistics, military assets management, retail, healthcare, shipyards, oil & gas, public sector, government and many more. Applications include product traceability, asset tracking, brand security, maintenance and manufacturing process control. DAxO are headquartered in Italy and specialise in reducing costs and improving logistics operations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/daxo.png','Daxo','ISV','http://www.daxo.it',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('dcare','Dcare Srl, (Owned by DAxO Srl and Dedalus SpA) provides Mobile and RFID technologies to the healthcare sector. Their solutions provide the means to certify patients pathways within healthcare structures, as well as provide full traceability of all healthcare assets (patients, operators, equipments, documents and instruments).','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/dcare.png','D Care','ISV','http://www.rfidcare.it',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('demoteller','DemoTeller Systems, Inc. is a leading provider of financial card instant issuance software and hardware. Utilizing a combination of DemoTeller Systems Inc.s TRISM software and Zebras ZXP8 retransfer printer, banks and credit unions can issue photographic quality debit cards at the new accounts desk. In addition, DemoTeller Systems, Inc. also offer PIN Selectors, encoders, card activators, plastic cards, card readers, ATM demonstrators, embossers, and toppers. For over 25 years DemoTeller Systems, Inc. has been among the elite in electronic transaction technology providing financial institutions with quality products. We strive to develop the future for card transaction technology best suiting your specific applications','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/demoteller.png','Demoteller','ISV','http://www.demoteller.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('Digitalfuture','Digital Future Engineering is specialized in designing and developing hardware/software solutions and integrations aimed to satisfy needs of customers in various fields.\n \nOur mission is to solve complex tasks with easy to use solutions and to provide high level maintenance and evolution of our products. Our commitment has been appreciated in wide areas, mainly in the healthcare, where over 14 years of experience allowed us to create a highly performing medical information platform called HIPPOCRATES. \n\nHIPPOCRATES offers medical data storage and analysis, network scalability and multi platform accessibility with unpaired possibilities of customization that makes it a perfect solution for any specialty.\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/DigitalFutureE.png','Digital Future Engineering','ISV','http://www.dfuture.it',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('digitronica','Digitronica.it provides 360 degrees of Information & Communication (IT) services, and is the ideal technological partner to build, maintain and update the companys security software solutions. The company designed an innovative suite of customisable products for the security that telecommunication, production and great distribution companies, plus local authorities, airports and universities are presently using.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/digitronica.png','Poligoods (Digitronica)','ISV','http://www.digitronica.it',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('dnet','DNET began its activity in 2003 in order to develop technological solutions for different industry sectors, commerce and services. They offer on-site accreditation which includes reading and traceability systems such as barcodes, BIDI-codes or RFID-chips. They are also specialists in access control, including capacity and stay management for all kinds of events, congresses, fairs, concerts or sport shows, Ticket control (Ticket2Access), Radio Frequency (RFID) and face-biometry (Face2Access).','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/dnet.png','DNet','ISV','http://www.dnet.eu',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('dovetail','Dovetail is a software provider to the logistics, transport, 3PL and warehousing industries. Our product spans the entire logistics and supply chain industry, from courier to road freight to distribution to warehousing; whether you\'re a small business or large global concern, Dovetail can tailor-make a solution that suits you, helping you streamline your business, from the boardroom to the engine room, placing you ahead of your competitors.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/dovetail.png','Dovetail Solutions','ISV','http://www.dovetail.co.za',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('eax','EAX Technologies is a software development and embedded solutions company based in Monterrey, NL, Mexico. The company offers enterprise mobility and application integration solutions and development services for the automotive, industrial, retail and financial markets. We aim to provide turnkey solutions for our customers and we have a proven record of successfully projects. We are experts integrating information, applications and devices in real time for enterprise mission critical scenarios. EAX Technologies es una compana de desarrollo de software y soluciones embebidas basada en Monterrey, N.L., Mxico. La compaa ofrece soluciones de movilidad e integracin de aplicaciones y servicios de desarrollo para el mercado automotriz, industrial, comercial y financiero. Nuestro objetivo es proporcionar soluciones a la medida para nuestros clientes y tenemos un historial probado proyectos exitosos. Somos expertos en la integracin de informacin, aplicaciones y dispositivos en tiempo real para los escenarios empresariales de misin crtica.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/eax.png','EAx Technologies, S.de R.L. de C.V.','ISV','http://www.eaxtechnologies.com.mx ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('eirpoint','Eirpoint designs, develops and implements software solutions to assist with the identification and exploitation of greater efficiencies in stock control, traceability and business operations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/eirpoint.png','IT Providers Ltd (Eirpoint)','ISV','http://www.eirpoint.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('erpintegrated','ERP Integrated Solutions is a recognized leader in helping organizations seamlessly integrate multi-carrier/multi-mode shipping functionality directly from within the SAP ERP system hence eliminating the need for external shipping solutions. Through their SAP Certified Shipping Solution called ShipERP(tm) which integrates with over 200 shipping carriers/freight forwarders worldwide as well as through their extensive SAP Supply Chain expertise, ERP Integrated Solutions is able to provide business efficiencies that come with a strong Return on Investment. ShipERP(tm) integrates with all major shipping carriers which includes but is not limited to FedEx, UPS, DHL, USPS, TNT, Purolator, DPD and YRC.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/erp-integrated-solutions.png','ERP Integrated Solutions, Inc. ','ISV','http://www.erp-is.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('esprida','Esprida is an industry leader in remote management software for intelligent system and devices. Financial services organizations, retailers, and government agencies use Esprida to enhance their business processes, workflows, create efficiencies and introduce innovative solutions to the market through various channels.  Providing Enterprise and Software as a Service (SaaS) product lines, Esprida enables businesses to manage and control networks of devices in diverse locations from a Web browser. Esprida LiveControl delivers device-generated intelligence and device-oriented analytics to maximize availability, manage the devices use of consumables, enhance the user experience, increase revenue and transform business strategies and operations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/esprida.png','Esprida','ISV','http://www.esprida.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('etraceti','Una plataforma SGR con 7 aos de experiencia en Mxico que ofrece incrementar la productividad de las empresas a travs del monitoreo total de los activos y del personal.  Gestin de operaciones de mantenimiento y servicio con personal de campo  Monitoreo en tiempo real de manera integral en los diferentes rubros Monitoreo del vehculo, aspectos logsticos temas de seguridad  Hbitos de manejoNuestra plataforma tiene la flexibilidad de adecuarse a las necesidades de cada cliente.  Ofrecemos acceso a nuestra aplicacin desde un celular hasta una tradicional computadora.  Toda la informacin est disponible en tiempo real las 24 horas del da.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/etrace.png','E-Trace TI','ISV',NULL,1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('europlus','NiceLabel is the world\'s leading developer of barcode and RFID labeling software. Through its offices in EU, USA, Asia and its global partner network, it provides labeling solutions to companies of all sizes, across most industries, delivering higher supply chain efficiency and data accuracy at lower costs: software for label design, error-free manual printing, automated labeling from other applications and cloud hosted web printing. NiceLabel is a Microsoft Gold Certified Partner, Oracle Gold Partner and SAP partner. NiceLabel is also the world\'s leading developer of Windows drivers for thermal printers. Most leading printer manufacturers ship NiceLabel-based software with their printers. ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nicelabel.png','Europlus (Nice Label)','ISV','http://www.nicelabel.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('eurosmartz','EuroSmartz was the first company to bring the functionality of printing photos, contacts, web pages and more to the iPhone when it released its \"Print\" app in December 2008. Since then, EuroSmartz has become the number one provider of business apps for the iPad, iPhone and Android devices  achieving 3 million paid downloads of its paid applications to date. EuroSmartz\' app \"Print n Share\" was selected by Apple to be featured in the \"Office\" iPhone TV commercial which aired globally in 2009. In 2010 EuroSmartz\' other leading app \"PrintCentral\" was featured as \"App of the Week\" in the UK and European iTunes App Stores. EuroSmartz apps stand out in the market for their comprehensive, multi-function capabilities. A EuroSmartz app is purchased every 51 seconds, and 85% of people who have bought the original Print app are still using it.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/eurosmartz.png','Eurosmartz','ISV','http://www.eurosmartz.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('evention','Evention LLC is a software provider that is reinventing back-office management for the hospitality industry. Evention offers a suite of products including Evention Tips & Gratuities, Evention SecureDrop, and Evention Shuffler which are utilized in marquee hotels across the globe. Evention SecureDrop automates cash management starting off with printed drop/dueback labels while also generating electronic records that flow completely through the cash journaling process. By overseeing cashier drops, duebacks, banks, over/short tracking, and audits against the POS & PMS with an Internet-based software system, SecureDrop has helped many hotel properties completely automate cash management.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/evention.png','Evention','ISV','http://www.eventionllc.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('exchangeit','ExchangeIt is a progressive software development company that specializes in Credential Production & Management Solutions. Their dedicated team comes with over 15+ years experience in the development of secure credential issuance software, database management, and contactless encoding such as MIFARE, MIFARE DESFIRE, etc. ExchangeIt manufactures CardExchange, which is a universal Card Management, Printing, and Encoding Solution. CardExchange I.D. Card Production Software provides a wide range solutions that range from basic I.D. Card Software to highly sophisticated custom solutions that can be adapted to provide a solution for any customer.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/exchangeit.png','ExchangeIT (Card Exchange)','ISV','http://www.exchangeit24.eu',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('fenyasoft','FenyaSoft specializes in the development of software that automates repetitive business processes which ultimately result in one or more accounting transactions. Our speciality is the provision of software and solutions, which include barcode scanner applications, that integrate into Pastel Accounting and to this end we are an authorised Pastel Value Added Reseller and Certified 3rd party developer. We provide a turnkey service that consists of Pastel product sales, barcode scanner hardware and software sales, mobile printing, specialized training, advanced technical support (Pastel data fixes and the like), software development, web design & development and web hosting.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/fenyasoft.png','Fenyasoft','ISV','http://www.fenya.co.za',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('formfast','FormFast\'s technology simplifies...streamlines...strengthens processes across the enterprise - including clinical, financial, administrative, HR, risk management and ERP workflows. Serving more than 850 hospitals worldwide, FormFast accelerates progress from time-consuming manual processes to fully automated workflows.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/formfast.png','FormFast','ISV','http://www.formfast.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('foundrylogic','FoundryLogic builds its Retail Mobile Suite software for Retailers that are running the Retail Pro point of sale software system. Retail Mobile Suite is a complete mobile inventory and sales solution. Retail Mobile Suite provides seamless integration to Retail Pro through both online wireless and batch processing modes. Retail Mobile Suite allows you to perform Mobile POS, Line Busting, Physical Inventory, Receiving, Inventory Transfer, Inventory Check, Receipt Printing, and Label Printing on mobile devices. FoundryLogic is a certified Retail Pro Development Partner and Zebra ISV.  ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/foundrylogic.png','FoundryLogic','ISV','http://www.foundrylogic.com ',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('foxfire','Foxfire makes software for inventory management and warehouse management. Our clients normally want a barcode based inventory system and they say that our software helps them significantly improve inventory accuracy and work force efficiently resulting in more revenue, higher profits and less errors. We work with all sizes of inventory operations from small to large.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/foxfire.png','Foxfire','ISV','http://www.foxfiresoftware.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('galaxy','Galaxy International Group is a Microsoft Certified Gold Partner, technology Solutions Provider and an Independent Software Vendor (ISV) providing high quality information technology solutions, systems integration, financial solutions and e-Business solutions to commercial and government customers in the UAE, Middle East.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/galaxy.png','Galaxy International Group','ISV','http://www.gi-group.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('gemalto','Gemalto is the world leader in digital security with 2010 annual revenues of 1.9 billion and over 10,000 employees operating out of 87 offices and 13 Research & Development centers in 45 countries. Gemalto is at the heart of our evolving digital society. Billions of people worldwide increasingly want the freedom to communicate, travel, shop, bank, entertain, and workanytime, anywhere, in ways that are convenient, enjoyable and secure. Gemalto delivers on the growing demands for personal mobile services, identity protection, payment security, authenticated online services, cloud computing access, modern transportation, e-healthcare and e-government services. Gemalto does this by providing secure software, a wide range of secure personal devices, and managed services to wireless operators, banks, enterprises and government agencies. For more information visit www.gemalto.com, www.justaskgemalto.com.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/gemalto.png','Gemalto','ISV','http://www.gemalto.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('generix','Generix Group develops software solutions for retail, industry and 3PL markets. GNx provides a complete offer for Supply Chain players, enhancing collaboration between companies. We propose added value to our customers, with quality applications, strong consultancy skills and proper R&D investment.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/generix.png','Generix','ISV','http://www.generixgroup.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('geoforms','GeoForms specialises in understanding its client\'s business processes to develop optimised mobile technology solutions for frontline staff. We supply a range of smartphone-based ANPR applications for UK police and private sector parking managers, to add to our mapping and tracking software','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/geoforms.png','GeoForms Research','ISV','http://www.geoforms.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('gesp','An Italian company operates for over a decade in Geographic Information Systems (GIS) and more generally, in the field of geo-spatial computer applications, developing custom projects for every need and every client. The companys mission is that of creating specialized solutions aimed to the integration of geographic and spatial information in company information systems, at any scale and level of detail, contributing to the greater competitiveness of its clients. The company works especially on integration between GIS and other advanced technologies, such as GPS (Global Positioning System), mobile devices (smartphone, tablet, printers), and dedicated systems existing in some market areas: environment, utilities, transportation, modeling and so on.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/gesp.png','GESP','ISV','http://www.gesp.it',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('globalventure','Global Venture was established over two decades ago with a mission to provide the highest quality products at competitive prices, with emphasis on service. We offer top of the line products; from pressure sensitive labels and tags to RFID solutions, while maintaining an Environmentally Friendly Production, recycling 90% of our waste products. Over 50 dedicated and loyal employees provide our clients friendly service while delivering consistent quality products. Our Friendly Office Staff, our Qualified Pre-Press Personnel and our Highly Trained Production Group has made Global Venture a dependable resource for our clients. We proudly serve our client base from our 50,000 square feet state of the art facility in Kent, WA.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/globalv.png','Global Venture','ISV','http://www.globalventurelabels.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('gooddeal','Good Deal has invented a new way of delivering coupons to shoppers targeted to their shopping habits. Shoppers call it The Coupons Machine, an easy-to-use interactive kiosk located at the entrance of the supermarkets. An easy, fast and convenient way to take full advantage of coupons and save money in every purchase. An efficient tool that enhances shopper loyalty, multiplies coupon redemption by 4 and can increase store sales up to 10.000. The kiosk is also available for mobile devices through an APP and can be maximized with the Good Deal CRM software.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/good-deal.png','Good Deal','ISV','http://www.gooddeal.es',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('grupponazca','Nazca boasts 15 years experience of designing, developing and supporting innovative enterprise solutions, that are highly complex but nevertheless user friendly and specifically tailored to meet individual customer needs. Today Nazca offers business applications available on cloud, which can be integrated with the clients\' infrastructure and systems in order to make the process management more fluid and dynamic: an investment aimed at improving in terms of efficacy, speed and efficiency, for a genuine competitive advantage. Nazca also provides outsourcing services for the Mobility Management, Document Management, Help Desk technical support and Consulting. Nazca Work Force Management is the system of management and coordination of internal and external technical employees.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nazca.png','Nazca Ricerca / (Gruppo Nazca)','ISV','http://www.grupponazca.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('handheld','Handheld Logic has deployed over 90 enterprise mobility solutions world-wide since 2004. Our team is a unique collection of award-winning Microsoft MVPs in Mobile Development, published authors, trainers, and recognized experts in all aspects of enterprise mobility. Companies like Microsoft, Wal-Mart, Comcast, El Paso Energy, SimplexGrinnell, Frontier Airlines, Thomson Healthcare, and over 40 others depend on Handheld Logic for top-shelf custom mobile solutions, massive scalability, and rapid time to deployment','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/handheld.png','Handheld Logic','ISV','http://www.handheldlogic.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('handpoint','Established nearly 20 years ago, handpoint are experts in multi-platform, multi-channel retail payments and are able to provide global solutions, regardless of currency or local regulation. handpoint are also mobile payment experts offering a wide choice of secure EMV mobile payment options on mobile payment terminals and even on smartphones like the Android and iPhone.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/handpoint.png','Handpoint','ISV','http://www.handpoint.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('helimedia','HeliMedia supply Form Patrol, an enterprise, multi-platform, mobile information management system transforming manual, inefficient paper based processes into electronic versions that are automatically processed and sent to populate multiple backend systems. Any number of forms or tickets can be completed on PDA\'s or Blackberrys. Form Patrol helps police, local councils, public service providers and other organisations to eliminate costly, time-consuming paperwork, realising significant cost and efficiency savings by creating leaner business processes.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/helimedia.png','Helimedia','ISV','http://www.formpatrol.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('hiberus','Hiberus Technology is a company specializing in business consulting and technology services and outsourcing. It is the leading technology company in the Ebro Valley, a reference in the Spanish market. Hiberus offers a wide range of technological and business solutions (Business Consulting, Solutions Implementation, AMS, Factory Software, BPO, Outsourcing, Managed Services and System Integration) under a hyper specialization model.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/hiberus.png','Hiberus','ISV','http://www.hiberus.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('hst','HST is a software development company focused on delivering solutions for smart card issuance and electronic payments. HST provides comprehensive solutions for EMV migration, including consulting, issuance, online processing and terminal acceptance.  HST Products:Smart Cards: EMV Centralized Issuance Cards, EMV Instant Issuance Cards, Card Designer, Data Preparation Software, Host Scripting (full-EMV), EMV Kernel, and NFC Solutions. Security: KMS Key Management System, CA, HSM, ISCF. 3D Secure: HST offers the Authentication Server (ACS) and Merchant Plug-in (MPI). Self-Service Terminals Administration and Application Software & Terminals Drivers for devices. Services: Consulting, Training, Certifications, integrations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/hst.png','HST Card Technology','ISV','http://www.hst.com.br ',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('hybrid','Hybrid Paytech, located in Montreal, Canada, integrates and develops mobile applications and hardware for the payment industry, emphasizing on point-of-sale purchase and client authentication, EMV/PCI compliancy and transactional/data security. With custom, patent-filed software applications and processes, Hybrid is one of the most advanced companies in its industry, specializing in all transactional processes (client/card present, client/card not present) in fleet, E-commerce and brick-and-mortar environments. Hybrid prides itself in its scalability over their multi-use software, hardware peripheral devices and strong back-end and reporting tools.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/hybrid.png','Hybrid Paytech','ISV','http://www.hybridpaytech.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('id3','id3 Technologies is a company specialized in the design and manufacturing of electronic products and solutions in the radio frequency contactless (RFID) and Biometrics fields. Founded in 1990, our company solve technological challenge by developing highly innovative and high performance solutions, designed by its team of experts around id3 unique portfolio of IP and technologies in RFID and Biometrics.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/id3.png','iD3','ISV','http://www.id3.eu',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('id4sense','ID4sense is a technology boutique focused on the design, development, and customization of new technologies and solutions within the healthcare industry, including RFID based wristbands, antennas, software, and a variety of sensors. By providing state of the art tools we enhance the security and efficiency of the daily ongoing operations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/id4sense-logo.png','Id4Sense','ISV',NULL,1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('ideologica','Established in 1995, the Ideolgica company built a solid base with more than 1000 points of sales installed including customers in Brazil, Mexico, Angola, Venezuela and Colombia.  Ideolgica\'s software, AllegoNet, is a leading system in the automation of franchise networks in the laundry, sewing and repairs segment. The software provides tracking, automatic sending of messages, loyalty programs, biometric identification, delivery routes, commissions and more.\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/ideologica.png','Ideolgica Informtica','ISV','http://www.ideologica.com.br',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('ihandhaving','iHandhaving provides a very comprehensive and flexible system for mobile law-enforcement & surveillance purposes based on standard Smartphones like iPhone, iPod, iPad, Blackberry and Android. The solutions is extremely flexible, modulair based and fully integred with Zebra Mobile printing technology. See our reference video at http://www.ihandhaving.nl/ or contact us for more information.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/ihandhaving.png','Globe Software (iHandhaving)','ISV','http://www.ihandhaving.nl',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('imageware','ImageWare Systems, Inc. is a leading developer of identity management solutions, providing biometric, secure credential and law enforcement technologies. Scalable for worldwide deployment, the Company\'s biometric product line includes a multi-biometric engine that is hardware and algorithm independent, enabling the enrollment and management of unlimited population sizes. ImageWare\'s identification products are used to manage and issue secure credentials including national IDs, passports, driver licenses, smart cards and access control credentials. ImageWare\'s digital booking products provide law enforcement with integrated mug shot, fingerprint Livescan and investigative capabilities. ImageWare is headquartered in San Diego, with offices in Portland, OR, Washington DC and Canada.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/iws.png','IMAGEWARESYSTEMS ID GROUP','ISV','http://www.iwsinc.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('Incod','INCOD is a developer of software solutions for the identification, logistics, traceability and monitoring of production lines, with over 20 years of experience. \nWe develop projects through integrated hardware and software companies in sectors such as food, pharmaceutical, automotive, chemical, and logistics.\nSolutions include applications for labeling and marking, printing device management, RFID applications, card, Mobility (Android, Linux, iOS, Windows Mobile) and Middleware for integration with ERP, MES and WMS.\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/incod.png',' Incod Enginyeria Industrial SCCL ','ISV','http://www.incod.es',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('infocomm','Infocomm Group is a leading mobile and wireless solutions and services provider. Headquartered in Muscat, Sultanate of Oman with offices in Dubai, United Arab Emirates, Singapore and currently active in 12 countries. We specialise in exploiting the tremendous potential of mobile communication as a new interactive media channel and leveraging it in the online environment. As well as being pioneers in mobile marketing and standard setters in wireless solutions and mobile apps; we design and develop cutting edge customised solutions leveraging on open source integration coupled with business intelligence and analytics solutions powering our clients along the information highway. Our award winning mobile parking, mobile wallet and enforcement solutions for government departments has dramatically improved the life of motorists in various cities.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/infocomm.png','Infocomm Group ','ISV','http://www.i-grp.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('infologic','Prsent dans lvolution et la mutation de lagroalimentaire multi-filires depuis plus de 30 ans, INFOLOGIC dite et intgre une solution ERP complte et accessible. COPILOTE est devenu indispensable  de nombreuses entreprises industrielles ou de ngoce, dsireuses de dvelopper et dynamiser leur activit. Crativit, anticipation des quipes et technologies innovantes garantissent la prennit et laccompagnement de vos projets. 450 sites, de la PME au grand groupe, pilotent dores et dj leur activit avec COPILOTE.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/infologic.png','Infologic','ISV','http://www.infologic.fr ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('innovatrics','Innovatrics is focused on providing fast, accurate, interoperable and sensor independent fingerprint recognition software for incorporation into final biometric applications. By working closely with global partners, Innovatrics pursues its vision to bring the ultimate fingerprint recognition software to various biometric market segments and applications such as access control, network security and identification systems.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/innovatrics.png','Innovatrics','ISV','http://www.innovatrics.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('inok','Swiftracker is a new generation fixed asset management tool. One single asset management system yet allowing different departments to view and manage their assets independently. Maximum flexibility and scalabilty. Using intuitive UI and familiar mobile devices to scan and manage your physical assets mean lower cost and no specialist training required.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/inoksystems.png','INOK Systems','ISV','http://www.inoks.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('inovacao','INOVAO COMPUTAO MVEL LTDA is a Brazilian software company specialized on mobility, in special, mobile solutions for Utilities. We are in the market since 1996 and we are one of the leading companies in this segment in Brazil. Our main solution is the READER for onsite billing.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/inovaco.png','Inovao Computao Mvel Ltda','ISV','http://www.inovamobil.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('interahadar','Since 1990 the INTERA Consulting professionals working in the area of information technology. At the beginning the main focus was the development of systems in languages 4th generation and training. In those year, serving customers special and going through the most adverse market trends, as our customers have achieved excellence and experience, where we offer all our expertise to your business.  ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/intera.png','INTERA HADAR Consultoria','ISV','http://www.interaconsultoria.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('intercede','Intercede is a security software provider whose MyID identity management platform enables the creation of trusted digital identities for employees and citizens on secure devices such as smart cards, smartphones and tablets. MyID enables the protection of intellectual property, assets and digital content, delivering trusted digital identities as the cornerstone of cyber security strategies for government, defense, financial services and other industries. It is used worldwide to manage millions of identities and supports the latest standards for PIV, PIV-I and CIV deployments. Intercede are also leaders in developing innovative applications for new technologies, especially mobile identities.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/intercede.png','Intercede','ISV','http://www.intercede.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('intercon','Since 1983, Intercon has established itself as a leading provider of prescription warning label software solutions. Our products are integrated across major pharmacy management software platforms and supported by all major medical database companies. Intercon programmers and technicians possess an exceptional assemblage of expertise in label preparation and printing technology. Leveraging this knowledge base, Intercon provides solutions that integrate with existing pharmacy label printing environments and maximize investment in information technology.\n\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/intercon.png','Intercon Associates ','ISV','http://www.interconweb.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('inthehand','We hand-craft apps and components for mobile and embedded devices. We have 14 years experience of working with mobile devices from the earliest data services on mobile phones to the latest smartphones and tablets. We work with the full Microsoft mobile portfolio from Windows Tablets down to custom Windows Embedded boards. We support iOS and Android using Xamarin. Our experience includes receipt and label printing on Zebras range of mobile printing devices.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/inthehand.png','InTheHand','ISV','http://inthehand.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('irmcs','iRMCS is the exclusive Asia distributor for Aralco Retail Systems from Canada  a powerful all-in-one Inventory, CRM, EDM, Membership, Loyalty and Gift Card Program, Finance and Point-of-Sale (POS) Management Software,  specifically designed to meet all the needs of single-store and chain-store retailers and any distribution businesses with built-in real-time  CMS and Ecommerce solutions on a single platform. Types of applications -  Card Applications, Mobile POS, Point of Sales, Merchandising, Labeling, Loyalty Card, Mobile Printing\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rmcs.png','iRMCS','ISV','http://www.irmcs.asia/retail-solutions/solutions-overview',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('itag','Somos uma empresa no ramo de prestao de servios, levando a soluo RFID a toda uma gama de clientes com necessidades de controle sobre seus produtos e agilidade em seus servios. Como a primeira empresa integradora homologada GS1 do Brasil a gerar o padro EPC na are do vesturio, somos hoje destaque e exemplo no senrio comercial de servios no seguimento de Implantao e implementao de recursos de identificao por rdio frequncia em toda a Amrica latina.  ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/itag.png','Itag Tecnologia','ISV','http://www.itagtecnologia.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('ivymobility','Ivy Mobility provides Mobile solutions to large and mid-sized enterprises for their global needs - across the 5 OS platforms of iOS, Android, WM, BB and Symbian - the right priced device and solution for the right market - a low-cost solution for an emerging market on a low-end device and a Tablet for a developed market. Ivy Mobility provides an end-to-end interface for customers - carrying and integrating with an ecosystem of device makers, telecom operator and the mobile solution integrated into any backend system.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/ivy.png','Ivymobility','ISV','http://www.ivymobility.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('jedren','Jedren is an Independent Software Vendor which has been active since 2008. They specialise in application development for devices used in data capture via bar codes and RFID tags. They cover three main sectors, namely Retail, Field Force Automation, and Warehousing. They offer both customized applications for projects as well as standard applications which offer ease of implementation and reduced lead times.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/jedren.png','Jedren','ISV','http://www.jedren.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('karteksmartsoftcardtek','Cardtek, was founded in 2001 to develop chip-based EMV and payment software, and to provide services for card payment systems and smartcard technologies. Cardtek also entered the payment processing solutions arena in the second half of the current decade, and is now among the leading companies manufacturing an extensive range of products for both horizontal and vertical markets. Cardtek\'s card issuance products, both Central and Instant, have become leadership products for card bureaus and financial institutions in Europe and North America.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/cardtek.png','Kartek Kart ve Biliim Teknolojileri / Smartsoft / Cardtek ','ISV','http://www.cardtek.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('kirona','Kirona are a leading provider of Field Force Automation solutions, with a fully end-to-end approach that incorporates software and transformation services. We tailor our approach to guarantee our customers achieve their business goals; increasing the number of jobs they carry out each day, reducing overheads such as fleet mileage and administration, and providing better customer satisfaction.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/kirona.png','Kirona','ISV','http://www.kirona.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('kodit','Established in 1992 Kodit Database Ltd has amassed significant technical ability to create intelligent mobile data collection / verification solutions in the areas of Health, Asset Maintenance, Asset Lifecycle Management and Emergency Response Management. The applications, including the CAREMagic Patient Care System, are deployed \"in the Cloud\" using internationally recognised standards for communications and data security.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/kodit.png','Kodit Database Ltd','ISV','http://www.kodit.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('kruger','KRUGER ofrece servicios en Middleware (Capa media), que incluyen SOA (Services Oriented Architecture), BPM (Business Process Management), Consultora en Arquitectura Empresarial, Desarrollo en Java y .Net, Anlisis de Sistemas (Analytics) y Testing. Somos especialistas en IBM, Oracle y Software Open Source o de cdigo abierto.  \nNuestros clientes son empresas privadas, locales e internacionales, que lideran sus mercados y buscan con nstantemente ser competitivos por medio de invertir en optimizar sus operaciones para atender mejor a sus clientes, expandir sus operaciones, lograr mayor rendimiento financiero y hacer crecer sus negocios. Nuestros clientes buscan relaciones profesionales de confianza, socios estratgicos que los ayuden a innovar y tener una amplia visin de su negocio y los acompaen para alcanzar sus objetivos y metas de xito.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/kruger.png','Kruger Corporation S.A.','ISV','http://www.kruger.com.ec ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('levirayschoop','For over 25 years, Levi, Ray & Shoup (LRS) has been providing print management solutions for the medical, manufacturing, financial, and other industries. LRS products give organizations a central point of control to manage their document and label printing devices from a simple web browser interface. Our VPSx software communicates directly with Zebra print devices to give administrators instant feedback about the status of label printing. Working with Zebra engineers, developers from LRS have fully integrated Zebra Printing Language (ZPL) support into the VPSx solution. When ribbon-out, low paper, printhead overheating, or other error conditions stop critical label printing, the VPSx solution notifies administrators  before critical business processes are affected.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/levi.png','Levi, Ray & Schoop','ISV','http://www.vpsx.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('livewire','Livewire is the Power to Connect, creating software solutions for kiosks, digital signage, and mobile applications, all managed from our eConcierge Content Management System. Our many turnkey solutions increase revenue and productivity for our customers, while lowering overhead and providing seamless integration. Livewire provides cutting-edge software, hardware consulting, and system integration, bringing the necessary puzzle pieces together to increase customer engagement and a better end-user experience.  Simply put, we build software that elevates your experience and exceeds your expectations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/livewire.png','Livewire Digital','ISV','http://www.livewiredigital.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('loc','LOC Store Management Suite is a complete suite of applications designed for the retail industry. Store Management Suite was created to eliminate the need for retailers to look further for a more integrated solution. From product management, customer loyalty programs, warehouse management, inventory control, cashier balancing, label package and electronic journal, LOC Store Management Suite provides all retail needs. Discover our regular and promotional sales reports by product, margin, stock count, trends, cost management, inventory, cashier balancing and much more. Our store management suite is designed to ease your management tasks at the point of sale and back office.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/loc.png','LOC Software','ISV','http://www.locsoftware.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('loftware','Loftware is the global market leader in Enterprise Labeling Solutions with more than 5,000 customers in over 100 countries. Offering the industry\'s most comprehensive labeling solution, Loftware\'s enterprise software integrates with SAP, Oracle and other enterprise applications to produce mission-critical barcode labels, documents, and RFID Smart tags across the supply chain. Loftware\'s design, native print, and built-in business rules functionality drives topline revenue, increases customer satisfaction, and maximizes supply chain efficiency. With over 25 years of industry leadership, Loftware\'s enterprise labeling solutions and best practices enable leading companies to meet their customer-specific and regulatory requirements with unprecedented speed and agility.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/loftware.png','Loftware','ISV','http://www.loftware.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('luggage','Luggage Logistics Ltd is an Aviation application provider specialising in baggage and passenger service systems. Luggage Logistics systems include the highly flexible Baggage Reconciliation / Management System (BRS/BMS) - Load & Track. Other applications include a Baggage Re-Flighting Application, ULD Container Management System and Door Side Passenger Boarding Reconciliation.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/luggage-logistics.png','Luggage Logistics','ISV','http://www.luggagelogistics.net',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('m3technologies','At M3t we have developed a fully integrated software solution to solve the problems of todays casino resort executives. Our system is designed to provide real-time data on all player activity and cash flow, property-wide. This system has been tested in some of the harshest casino environments and has withstood the test of time and extreme use - 24 hours a day, seven days a week. As part of our full system offering, M3t now offers five models of casino kiosks.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/m3t.png','M3 Technologies ','ISV','http://www.m3ts.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('magaya','Magaya Corporation develops logistics and supply chain software to serve the end-to-end needs of procurement, pricing, inventory control and more. Built on the values of innovation and constant improvement, our products are designed specifically for freight forwarders, NVOCCs, logistics providers, warehousing and DCs, importers, exporters, and others in the logistics and supply chain industries.  Our software is a complete package that integrates logistics, communication, and accounting features built on the award-winning Magaya Network. Companies can exchange documents for shipping and more with their customers and agents worldwide via the Network and give them real-time tracking online and on smart phones.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/magaya.png','Magaya Corporation','ISV','http://www.magaya.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('magstar','For 25 years, Magstar Total Retail continues to be a leading enterprise solution specifically for mid-sized Retailers. With fully integrated merchandising, POS, Accounting and Warehouse including end-to-end analytical, visibility and management tools, Total Retail creates complete transparency in multiple locations and multiple channels: brick and mortar, e-commerce, and catalog or wholesale order entry.  Zebra printers, when paired wirelessly with Magstar Mobile POS solutions, provide Retailers with unparalleled freedom to tender credit/debit transactions, line bust or manage returns all with bar code receipts.  Additional mobile functionalities include warehouse, inventory and label printing.\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/magstar.png','Magstar Inc.','ISV','http://www.magstarinc.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mappingsuite','MAPPING Suite is a software development company specializing in output management applications designed to provide cost-effective enterprise document management solutions to a wide range of businesses. Our scalable software suite enables complete data output automation and runs on major production operating systems. The portfolio of MAPPING Suite is divided into 2 separate offers:\nMapping Suite: Output management software solution.\nPrint Transform: Automated print file conversion and enhancement solution.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mapping.png','Mapping Suite','ISV','http://www.mappingsuite.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('marketpoint','Marketpoint has been delivering high performance, high quality sales and marketing services for 30 years. Our bespoke services include lead capture, response management, lead nurturing, data management and global telemarketing. Zuant a mobile lead capture app exclusively designed to help you get more performance from your shows for less effort. It is an elegant and responsive native iOS app that can run with or without an internet connection. Marketpoint Global Contact Centre Network is staffed with highly trained agents working in their native language and provides the backbone for our range of high performance services. Our Charity Division offers a range of services from creating and hosting online registration forms, inbound call handling, email response, pack fulfilment and literature storage.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/market-point-zuant.png','MarketPoint','ISV','http://www.mktpoint.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('medsystem','A Medsystem SV  uma empresa desenvolvedora de sistemas de gesto para todas as reas da sade, educao e aplicativos Mobile (APPs), tendo como base a TCI (Tecnologia da Comunicao e Informao).','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/medsystem.png','MEDSYSTEM S/V ','ISV','http://www.medsystem.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mifas','Mifas dates back to 1978, when a group of people from the Girona region(Spain) with a physical disability decided to form an association to promote the movement aiming to address the issues affecting them, and so to make up for the lack of representative groups in the sector. They developed Urban Intelligence System, which is the MIFAS Group\'s Smart City platform, devised and developed with the aim of controlling and optimising municipal management. UIS is made up of different modules, each of which focuses on the fundamental facets of the Smart City: parking, traffic, and incidents. MIFAS believe that citizens themselves should be at the heart of city life: UIS serves to compile data through human sensorisation by means of applications running on citizens\' smartphones. ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mifas.png','MIFAS','ISV','http://www.mifas.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('minisoft','Minisoft is a worldwide leader in delivering forms generation, email marketing and transactional ecommerce solutions. eFORMz is Minisofts comprehensive electronic forms and document management solution available for Windows, Linux, iSeries, HP/UX, or AIX. eFORMz converts standard ERP print output into attractive, functional form documents that can be distributed via print, fax, email or to archive. Use eFORMz to create packing lists, shipping labels, 1D/2D/QR barcodes, invoices, purchase orders and other critical business forms.  Minisoft has received numerous awards for its innovative software technologies and customer service. Minisoft has an ongoing corporate commitment to putting the \"customer first.\" We invite you to experience the Minisoft difference first hand.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/minisoft.png','Minisoft ','ISV','http://www.minisoft.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mint','Mint specialises in mobile payments, enabling software developers and businesses of all sizes to accept card payments on the move, in the field or on the shop floor. Mint\'s Mint Enterprise is a fully functional EFT payment client uniquely designed for mobile devices. It integrates to mobile business applications to become a seamless part of the existing business process while adding the complimentary benefit of EMV chip and PIN and local debit card payment acceptance. Utilising the Mint Managed Payment Service, it\'s able to process transactions globally without the need for bespoke integrations.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mint.png','Mint Wireless','ISV','http://www.mintwireless.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('miquest','Miquest is a comprehensive computerised maintenance management software solution, developed and supported by Miquest Software. Miquest has a variety of customers such as UK Fire & Rescue Services, Hospitals, Local Authorities, FM Service Providers, Ports & Shipping as well as customers within the Manufacturing & Process Industries. They all have one common aim: to track and maintain their assets to a world class standard, whilst meeting necessary compliance regulations, legislations and internal procedures. To do this, they use Miquest Software.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/miquest.png','Miquest','ISV','http://www.miquest.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mit','MiT Systems Enterprise Mobile Solutions provides businesses with the most flexible enterprise mobile solution in the marketplace today. Whether you are looking to provide mobile solutions to your sales or delivery workforce MiT can provide a solution that meets your exact business needs. Through a simple configuration dashboard our windows-based solutions can be quickly configured to provide businesses with a single, end-to-end solution that is comprehensive, yet easy to use. Together with our hosted or on-premise back office solutions we can supplement your enterprise functionality with the tools needed to manage a mobile work force, enhance your overall mobile solution and minimize the costs of integrations','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mitsystems.png','MIT Systems','ISV','http://www.mitsys.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mobileframe','Build Apps once and run anywhere. MobileFrame is the leading enterprise mobility platform, helping businesses gain a competitive advantage by replacing inefficient paper-based processes with automated mobile solutions to boost productivity and increase revenue. Challenge us! Send your paper form to sales@mobileframe.com and we\'ll write a custom mobile app and demonstrate it for you at no charge - you\'ll see how quickly and easily sophisticated applications can be built, deployed and managed using MobileFrame\'s Configurable Mobile ApplicationTM Platform.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mobileframe.png','Mobileframe','ISV','http://www.mobileframe.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mobilidade','A Mobilidade em Campo  uma empresa especializada no desenvolvimento de solues mveis para o mercado de Utilities: gua, Luz, Gs, Telecom, Lixo e Infraestrutura: Portos, Aeroportos e Rodovias.  Atualmente, gerencia centenas de agentes em campo, o que equivale  impresso de aproximadamente 25 milhes de contas de gua ao ano, sendo que, 100% das empresas atendidas, so concessionrias privadas de gua do Estado do Rio de Janeiro.  A empresa tambm possui solues de BPO, rastreamento de frotas e equipes, deteces de fraudes, monitoramento de redes inteligente e soluo de cadastramento geogrfico.  Localizada em um dos pontos mais nobres da cidade de So Paulo, ao lado das principais empresas de tecnologia, a empresa faz parte do grupo de Participaes e Investimentos da Houston Trust. E conta com uma equipe experiente para o desenvolvimento de solues diferenciadas nas reas remotas dos clientes.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mobilidade.png','Mobilidade em Campo ','ISV','\nhttp://www.mobilidadeemcampo.com',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mobinear','MobiNear provides Solutions for proximity Mobile interactions. Proximity Mobile communications or Near Mobile communications include short range communication technologies like: NFC, QR Code, WiFi, Bluetooth. MobiNear has developped MobiNear Tag (deploy interactive applications on smartphone mobiles) & MobiNear Box (Interact with Mobiles at your point of sales (PoS) with the MobiNear Box.) MobiNear\'s Vision: Use Your Mobile to access Services around You.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mobinear.png','Mobinear','ISV','http://www.mobinear.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mobisoft','MOBISOFT has been providing mobile barcode and data collection applications for over 15 years, specializing in Customer Ordering, Sales Force Automation and Mobile Labeling solutions. We provide highly intuitive, yet powerful solutions, directly to Retailers, and to Wholesale Distributors that supply Convenience and Grocery stores. In 2012 we introduced our line of iPhone, iPad and Android apps for Customer Ordering and Trade Show Ordering.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mobi.png','Mobisoft','ISV','http://www.MOBISOFT.mobi ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('moleq','MoleQ Inc. provides a complete supply chain solution to manufacturers, distributors, wholesalers, and retailers. Our VPOS (Point of Sale) system delivers integrated software and professional services for the retail demand chain in the food industry. We believe in providing a fast return on investment in technology for the long-term results of success and growth.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/moleq.png','MoleQ, Inc.','ISV','http://www.moleq.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('monraf','MONRAF is a company specialized in the development of POS applications with full support for vertical applications and integration solutions for the mobile world and labeling.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/monraf.png','Monraf','ISV','http://www.monraf.it',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('moonchase','Moonchase are the developers of Lab Online, a web-based information system for medical laboratories. Physicians use Lab Online to enter orders and review result reports from their desktop or mobile web browsers. Among the features of Lab Online are the computation of sampling requirements and the design, printing and scanning of specimen tube labels. Labels may contain configurable, unique barcode identification as well as human-readable information about the patient, work order or specimen.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/moonchase.png','Moonchase','ISV','http://www.moonchase.be',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mountainpass','MPS provides solutions to the ski and valet parking industries. Ski industry: EntryTM, UHF RFID ski lift access gate with biometrics to detect ticket transfers; Summit TM, a resort management and ticket POS; CrestTM, a budget POS for smaller ski areas. Both support ticket windows and mobile ticket sales in parking lots, cafeteria, lifts, and other convenient locations. Valet parking: Valley TellerTM, an automation system that logs all cash and credit transactions through preprinted bar coded tickets, mobile computers, and desktop and mobile printers. Convenient vehicle retrieval requests through QR scanning with text message confirmation.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mountainpass.png','Mountain Pass Systems','ISV','http://www.mountain-pass-systems.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('moving2u','M2U (Moving to You) develop mobile applications for process optimization via customizable standard packages or customer defined tailor-made applications. Operating out of Portugal, M2U are experts in Sales Force Automation, Field Services, Customer Relationship Management, Logistics and Proof of Delivery. M2U started in 2003 and is now recognised for providing software for mobile devices. They also offer consulting and training services as well as post sales technical support.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/moving2u.jpg','Moving2U','ISV','http://www.moving2u.pt',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mutsis','Techneon is a software company, providing complete auto ID solutions for businesses based on their unique needs. Techneon\'s talented and experienced software engineers have been working on various aspects of mobile and field applications since 2007. They cater for a number of vertical markets and applications, and have a diverse customer base in Turkey.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/techneon.png','Mutsis Bilisim San. ve Tic. Ltd. Sti. / (Techneon)','ISV','ttp://www.techneon.com.tr',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('mybusinesspos','MyBusiness POS Desarrollos, S. A. de C. V. somos una empresa dedicada a la fabricacin de software de punto de venta, control administrativo y facturacin electrnica. De 1991 a la fecha hemos provedo soluciones de software a decenas de miles de comercios y empresas, buscando que nuestros productos tengan un alto nivel competitivo funcional y comercial. En la actualidad somos lderes en Mxico en el ramo de software de punto de venta, gracias a la confianza de nuestros clientes finales, distribuidores y mayoristas de cmputo. Nuestros esquemas comerciales han buscando generar ganancias recurrentes para beneficio de toda nuestra cadena comercial.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/mybusiness.png','MyBusiness POS Desarrollos, S. A. de C. V.','ISV','http://www.mybusinesspos.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('nationalsoft','National Soft: Somos una empresa lder dedicada al desarrollo y comercializacin de software, ubicada en la ciudad de Mrida, Yucatn, Mxico. Actualmente contamos con presencia comercial en Mxico y varios pases de habla hispana a travs de nuestros representantes.  Nuestra especializacin es software en formato empaquetado (caja) de alta calidad pero en esquema comercial favorable para la adopcin de los negocios MiPyMes, apoyando la tecnificacin y aumento de competitividad de las mismas. Nuestra lnea de software se compone de Soft Restaurant sistema de administracin y control para restaurantes, NS Hoteles y On The Minute','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nationalsoft.png','National Soft','ISV','http://www.nationalsoft.com.mx ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('nedap','Nedap Retail develops and supplies innovative and sustainable solutions to manage and secure retail stores. We listen closely to our customers and keep a close eye on market developments. Our greatest strength is our ability to anticipate our clients\' needs. We look at the big picture. That\'s why our solutions always provide added value. Customers benefit from our expertise, experience and our ability to identify latent needs. We use these to create tailor-made solutions.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nedap.png','Nedap Retail','ISV','http://www.nedap.com',1);
