INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('neoris','Neoris is a global business and IT consulting company that specializes in SAP and application outsourcing. The company provides a comprehensive Mobile DSD solution using the eSOA capabilities of SAP to leverage the Business Process Platform. The solution covers Logistics , Trade & Marketing, Sales Execution and Commercial Assets requirements allowing companies to maximize existing SAP assets. Headquartered in Miami (FL), Neoris has more than 3,500 employees and operations in the U.S., Europe, Latin America, Africa, Asia and the Middle East. ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/neoris.png','Neoris','ISV','http://www.neoris.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('neutrino','Neutrino Technologies is a software development and consultancy company.  We develop and maintain bespoke software tailored to our client\'s exact needs.  Using a range of existing and mature software building blocks and having the experience needed, allows us to quickly and cost efficiently assemble a wide range of software systems.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/neutrino.png','Neutrino','ISV','http://www.neutrino.co.za',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('newspage','NewsPage\'s Express is a Distribution Management System (DMS) enterprise application software seamlessly integrated with a Sales Force Automation (SFA) handheld application software used by Fast Moving Consumer Goods (FMCG) companies across the globe. These applications manage and automate the activities of principals, distributors, sales and trade marketing management as well as representatives.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/newspage.png','Newspage','ISV','http://www.newspage.com.sg',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('niceware','Niceware is an independent software vendor (ISV) specializing in Application Workflow Design and Implementation built upon today\'s leading barcode label software platforms. Comprised of industry experts, Niceware understands the channels need for reliable and cost effective software solutions for advanced identification and tracking.  Niceware has an experienced team that is recognized within the AIDC reseller community for its work in successfully deploying thousands of partner applications. We are committed to help not only design solutions, but to educate partners how best to use barcode technology to help grow a business.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/niceware.png','Niceware International, LLC','ISV','http://www.nicewareintl.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('nofilis','noFilis is revolutionizing the way of working with AutoID and RTLS technologies since 2004 and became a recognized innovator and leader in the AutoID software market. The CrossTalk Product Family has been established as one of the leading device management, data capturing and Tracking&Tracing visualization technologies. CrossTalk provides a plug & play integration for most of the AutoID devices and backend systems on the market. Furthermore, CrossTalk supports a mix of technologies from major RFID, RTLS and Barcode providers. The CrossTalk AppCenter provides many pre-configured visual track & trace applications.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nofilis.png','nofilis','ISV','http://www.nofilis.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('nortialt','A Nortia IT  uma empresa Brasileira sediada na cidade de So Paulo, especializada em consultoria na rea de Tecnologia da Informao e com larga experincia em tecnologias mveis. Atendemos diversos mercados, com destaque para o mercado do varejo onde desenvolvemos a soluo de vendas mvel \"Nortia Sales Force Mobile\", que se integra ao ERP do cliente e utiliza dispositivos mveis em conjunto com uma impressora porttil, proporcionando mobilidade e agilidade ao vendedor para realizar o melhor atendimento e concretizar vendas com eficincia.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nortiait.png','NortiaIT','ISV','http://www.nortiait.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('nts','NTS is specialised in the development and integration of software solutions aimed at increasing the productivity of its customer\'s business processes, through three main business lines: mobility solutions, cloud computing technologies and data quality tools. Focused on counselling, consulting and systems integration, has developed, since it was founded in 2002, products and services for the most important enterprises in Spain, which means that its technology is currently being used by more than 50.000 users every day.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nts.png','NTS','ISV','http://www.nts-solutions.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('nueva','Nueva Gestin Informtica S.L (NGI) has over 25 years experience in developing software. They create mobility solutions on HTML5 environments, including the MovilGmao App, which improves the efficiency of asset maintenance. MovilGmao is a multiplatform mobile app (Android, IOS) intended for capturing data originated in the processes of maintenance of companies own personnel and subcontractors (hours dedicated, materials used, points of review of preventive maintenances etc.)','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/nueva.png','Nueva Gestin Informtica S.L','ISV','http://www.ngi.es',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('opensky','Opensky Data Systems is an enterprise technology partner and data specialist to some of the worlds most innovative and progressive private and public sector management teams.  We specialise in the design, build and support of transport, health, retail and environmental information management systems. In relation to label/receipt printing, our focus is on enterprise mobility in the above mentioned vertical markets.  Our applications can be designed for Microsoft, Android or iOS platforms and they can be integrated with most modern and some legacy back office systems.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/opensky.png','Opensky Data','ISV','http://www.openskydata.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pandaid','PandaID Soluciones, socio de ZEBRA por ms de 18 aos, ofrece soluciones de identificacin para cubrir las necesidades de mercados verticales como el bancario, lealtad, educacin. Somos un socio de negocios confiable, transparente y con un alto conocimiento tcnico.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pandaid.jpg','PandaID','ISV','http://www.pandaid.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('parsoftware','Our company develops real-time solutions based on web interface and client-server functionality. We have been on the top of mobility applications used by Technical Assistance Services for over 15 years with great results thanks to a strong database environment such as Openedge Progress. The application SAT10 is the heart of our business and consists in a vertical solution for all kind of technical assistance services. It`s also based on Progress technology, integrated with Google Maps and 3th party technologies like Zebra Utilities or Invox by Numintec. With a real-time functionality and with his mobile module for all platforms, SAT10 guarantees the improvement of all the resources of the company who install it.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/par-software.png','PAR Software','ISV','http://www.parsoftware.es',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pelesystem','PELE-SYSTEM es una empresa internacional, dedicada al desarrollo e implementacin de soluciones emergentes de alta tecnologa en las reas de seguridad ciudadana, planeamiento urbano, telecomunicaciones , logstica, gestin empresarial y administrativa, para el sector estatal y municipal as como para el sector privado de gran alcance. Nuestras soluciones, de probado xito en los ltimos 10 aos en 37 ciudades del mundo, son desarrolladas a travs de tecnologa Israel, la que es integrada de acuerdo a las necesidades particulares y especficas de nuestros clientes.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pelesystem.png','PELE-SYSTEM INC.','ISV','http://www.pelesystem.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('phc','PHC is exclusively dedicated to the development of applications for Business Management. We aim to provide solutions and tools that allow customers to increase their competitiveness. It is this constant quest for customer satisfaction, through software quality and simplicity in use that motivates PHC to permanent innovation, adding the new technologies and approaches to the applications which they consider allow the more than 25.000 companies that use PHC Software to obtain more results and reduce costs, while becoming more agile and productive.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/phc.png','PHC','ISV','http://www.phc.pt',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pierhouse','Pierhouse are the integrated signage management experts. NetTickIT and OnePoint software from Pierhouse help retailers manage all the data, processes and compliance to produce promotional tickets and in-store signage. NetTickIT bridges the gap between physical and digital customer communication points including shelf edge tickets, promotional point of sale, handheld devices and digital formats resulting in unified customer messaging. Our software is in use in over 55 countries worldwide and 35 different languages. We are a Microsoft Gold Certified Partner providing software and services.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pierhouse.png','Pierhouse Business Solutions','ISV','http://www.pierhouse.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pinesoft','Pinesoft develops bespoke software for the supply chain, logistics and mail sectors. Our application toolkit can scan an address, filter the image, read it with the integrated OCR engine, then process the data and print out a customised label with appropriate messaging. Fast and flexible, it can turn expensive, troublesome operations into highly profitable business.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pinesoft.png','Pinesoft','ISV','http://www.pinesoft.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('podfather','The PODFather is a mobile software solution designed for Logistics, Construction, Waste Management, and various Field Service sectors. The integrated PDA and web-based backoffice solutions allow you to manage your operations in real-time and communicate work orders to PDAs with completed forms returned within seconds of job completion. The PDA solutions incorporate mobile forms, electronic signatures, GPS, photographs, barcode and RFID scanning, with printed receipts using mobile Zebra printers. ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/podfather.png','Valley Technology / (PODFather) ','ISV','http://www.podfather.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('portech','Portech Systems Ltd (Portech) is a Wireless and Mobile computer solutions provider. Established in 1992 they have over a decade of experience in the mobile enterprise solutions market. Their expertise lies in developing and supporting cutting edge wireless software applications to improve business productivity. Portech works with companies to make serious in-roads into efficiencies, speed and cost reductions from an investment that is designed to pay-back rapidly.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/portech.png','Portech','ISV','http://www.portech.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('printeron','PrinterOn is the world\'s leading enterprise-grade mobile printing platform and has been delivering mobile printing solutions for 12 years to four major verticals: Enterprise, Education, Public and Home.  PrinterOn was the first to develop a cloud printing solution and uses cloud technology to enable users to print documents from any smartphone, tablet, or laptop to any PrinterOn-enabled printer. There are over 10,000 PrinterOn printing locations worldwide.  The PrinterOn Enterprise solution enables direct native printing from ERP platforms such as SAP and Oracle to any PrinterOn-enabled printer globally. PrinterOn works with most barcode, RFID and document printers. \n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/printeron.png','Printeron','ISV','http://www.printeron.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('prisymid','PRISYM ID design and deliver labeling software for organizations that need complete product auto-identification and lifecycle traceability. With over 30 years experience and product development in a wide range of sectors including life sciences, healthcare, automotive, chemical and general manufacturing the company boasts a comprehensive range of labeling software and consumables to meet industry specific compliance regulations. Headquartered in the United Kingdom, PRISYM ID has offices in the USA and Europe as well as a strategic network of partners to meet our customers\' needs on a global scale.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/prisymid.png','Prisymid','ISV','http://www.prisymid.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('processweaver','ProcessWeaver specializes in providing the most comprehensive automated multi-carrier global shipping solutions. ProcessWeaver solutions work with multiple carriers e.g. FedEx, UPS, DHL, USPS, TNT, Purolator, LTL, and TL as well as with freight forwarders. ProcessWeaver\'s Suite of products offer a simple, reliable, fast, and cost-effective way to address the critical business problems with its comprehensive list of proven solutions that can be deployed within the SAP/Oracle landscape or as a platform independent web application.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/processweaver.png','Processweaver','ISV','http://www.processweaver.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pss','PSS Products, MOBILeTY provides a configurable, easily interfaced, scalable product that allows for rapid deployment of a mobile solution without the cost of design, development, and trial and error.  It provides the ability to deliver a \"custom solution\" from a shrink wrapped package. MOBILeTY provides a flexible, modifiable engine capable of fully utilizing the current state of the art Portable Data Terminal (PDT) hardware. The MOBILeTY suite provides a scalable, configurable solution for the full spectrum of PDT environments. These include Retail, Warehouse, Distribution, Transportation Logistics, Field Service, Hospitality, Health Care, Route Accounting, and Manufacturing. MOBILeTY is is available as a purchased product or an SaaS business model.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pss.png','PSS Products','ISV','http://www.pssproducts.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pwrtecnologia','A PWRTech   uma empresa inovadora  com viso estratgica de mercado,  slida experincia em desenvolvimento e implementao de solues de automao Comercial e Industrial, que busca a excelncia e dinamismo para seus clientes e parceiros.  O programa Z-Odometer  foi desenvolvido pela empresa  PWRTech com o intuito de auxiliar no clculo, captura e interpretao dos dados de leitura da Kilometragem de impresso das impressoras trmicas Zebra, facilitando seus monitoramentos e manutenes, evitando desperdcios desnecessrios de etiquetas e ribbons  onde  comum nessa rea. O  Z-Odometer pode ser utilizado com conexes paralelas, serial e USBs. Com mais de 150 usurios ativos  no momento.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pwrtech.png','PWR TECNOLOGIA LTDA','ISV','http://www.pwrtech.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('pyramid','Pyramid can help make it easier for your customers to buy FROM YOU! We are a global leader in Life-Cycle IT consulting services including product development and support, QA/Testing, and local professional services. Leveraging  our offerings in Mobile Technology Services, Quality Assurance and Enterprise Application Services, Pyramid collaborates with ISVs, enterprise clients or even small business to quickly deliver solutions making your sale possible. Drawing on the talents and insights of our employees around the world, we combine knowledge, processes and reusable frameworks to enable our clients to grow by delivering innovative solutions rapidly as well as continuously providing business value.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/pyramid-consulting.png','Pyramid Consulting ','ISV','http://www.pyramidci.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('qad','QAD is a leading provider of enterprise applications for global manufacturing companies specializing in automotive, consumer, electronics, food and beverage, industrial and life sciences products. QAD applications provide critical functionality for managing manufacturing resources and operations within and beyond the enterprise, enabling global manufacturers to collaborate with their customers, suppliers and partners to make and deliver the right product, at the right cost and at the right time.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/qad.png','QAD','ISV','http://www.qad.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('qless','The worlds first and only mobile queing solution. QLess eliminates standing in line by letting people use their cell phones to enter a virtual line, roam freely while they wait, then receive a call or text message when their turn arrives at DMVs, doctors offices, retail stores, theme parks and everywhere that people wait. QLess is interactive, allowing users to request more time, leave the line or request a status update at any time.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/qless.png','Qless','ISV','http://www.qless.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('quetzal','Quetzal is a revolution in mobile retail Point Of Sale for today\'s small independent retailer. It is a cloud-based system that can be used on the desktop or on an iPad using the Quetzal iPad app. Its robust intuitive interface as well as elegant integrated hardware makes it a fast, trouble-free installation. Quetzal was purpose built using the latest technology to make it easy to import items, setup hardware, track inventory and integrate payments. Powerful reporting including a \"What do I buy\" velocity-based report, puts tier-one features in the hands of small business. Please visit http://www.quetzalpos.com/ today.\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/quetzal.png','Quetzal','ISV','http://www.quetzalpos.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('quicket','Quicket Solutions, Inc. provides electronic citations for law enforcement agencies.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/quicket.png','Quicket Solutions, Inc. ','ISV','http://www.quicketsolutions.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('quofore','Since 1998, Quofore has focused exclusively on developing next-generation, world-class mobile solutions for Consumer Products companies\' field sales, marketing, merchandising, and direct store delivery operations. Using our deep understanding of both enterprise-level solutions and smart technologies, Quofore is a global business solutions company that leverages its knowledge for our industry-leading clients through technology and highly specialized thought leadership.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/quofore.png','Quofore','ISV','http://www.quofore.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('qvs','For more than 20 years, QVS Software has been providing software and services to Tier 1 retailers around the world. Our mission is to provide enabling software that makes it easy for retailers to benefit from advanced retail system technology.  Based in Raleigh, North Carolina, the company derives its name from the Quality, Value, and Service that its retail clients and business partners have come to rely on. Because QVS works closely with the leading retail equipment providers, many retailers are already experiencing the benefits of QVS products. QVS is the voice of experience when it comes to \"state of the art\" store systems concepts such as migration strategies, operating systems, mobile solutions, and pervasive computing technology. The company is committed to enabling retailers to use best-of-breed equipment in deploying both mainstream and exciting new application solutions.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/qvs.png','QVS Software','ISV','http://www.qvssoftware.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('raptool','Raptool provides Mobile solutions - faster. With Raptool our partners make enterprise mobility applications without programming. In the PC-based designer they give your application life by adding functions through an intuitive click-to-add interface.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/raptool.png','Raptool','ISV','http://www.raptool.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rdt','Since 1999 RDT Systems has been providing retail technology solutions for small to medium size retailers. RDT is focused on implementing advanced technology with a competitive price/value proposition','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rdt.png','RDT Systems Inc','ISV','http://www.rdtsystems.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('realtimepos','For retailers looking to alleviate the financial burden of software purchase and maintenance, Real Time POS provides a hosted, highly scalable point of sale and retail management system that delivers complex, mission-critical functions that are necessary in today\'s competitive retail market. Real Time POS serves a variety of retail segments, including apparel, sports, books, furniture, Gifts, sporting goods, jewelry and more.  Retailers in today\'s market need to be able to instantly access POS and Inventory Control data in order to make quick and decisive adjustments to inventory quantities and levels, fulfillment and purchasing decisions. Real Time POS provides all the tools necessary to effectively manage every aspect of your retail operation in real time. Every transaction, inventory movement or adjustment and employee action is streamed instantly to and from the head Office.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/realtime.png','Realtime POS','ISV','http://www.realtimepos.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('redbeam','a leading provider of asset tracking and inventory control software designed to make business processes more efficient using handheld computers and Zebra desktop printers. Thousands of organizations in virtually every industry use RedBeam to save time and money. Please visit www.redbeam.com or email sales@redbeam.com for additional information or to schedule a web-based demonstration','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/redbeam.png','RedBeam','ISV','http://www.redbeam.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('reflexis','Reflexis workforce management/task execution solutions help retailers execute their strategy flawlessly and uncover profit. The integrated Reflexis platform of labor budgeting/forecasting/scheduling, time and attendance, task management, and KPI/compliance solutions enables retailers to align store labor/activities to corporate goals and institutionalize best-practice response to key metrics. Reflexis Adaptive Real-Time Execution Components enable store employees to detect key events and trends using real-time data from any source and respond to provide the highest possible quality of customer engagement.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/reflexis.png','Reflexis','ISV','http://www.reflexisinc.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('regate','Regate is a software house that specializes in enterprise mobility solutions for mobile devices, such as sales force automation, van invoicing (exvan), field force, etc. Regate helps businesses expand their business applications to mobile workers that spend most of their time on the field.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/regate.png','Regate ','ISV','http://www.regate.gr/',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('resco','Resco is the leading provider of controls, components, libraries, wizards and designers for Windows Mobile development. They have over 12 years experience in mobility with over 3,500 corporate Windows Mobile developers using Resco\'s tools. Resco\'s main product is MobileForms Toolkit which is an ultimate set of controls and components for Windows Mobile and other platforms which rapidly speeds up the development process.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/resco.png','Resco','ISV','http://www.resco.net',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('retailpos','Retail POS Solutions started in March of 2011, with the purpose of providing expert software services globally. The strategy was simple: Create software that works with existing major POS software companies such as Microsoft RMS, Dynamics AX, Quick books POS and POS 2009. Software that is easy and simple to use and works on both desktop and touch tablets. A software that streamlines the process of adding items, modifying items creating purchase orders, inventory, sales items, Graphs, and prints labels and much more.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/retailpos.png','Retail POS Solutions','ISV','http://www.retailpossolutions.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('retailpro','Retail Pro International is a global leader in Point of Sale, Store Operations, and Back-Office software applications for the specialty retail industry. For over 25 years Retail Pro has enabled retailers to achieve their full potential through a unique, scalable, reliable, and highly customizable retail management solution delivered via a dedicated world-wide support network.  Today, Retail Pro is used by more than 52,000 retail stores globally in markets such as footwear, apparel, collectibles, gifts, home furnishings, sporting goods, and accessories. With unparalleled functionality, flexibility and ease-of-use, Retail Pro has established itself as a trusted solution for today\'s specialty retailers everywhere.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/RetailProLog.png','Retail Pro International','ISV','http://www.retailpro.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('revision','Re-Vision is the leading provider of mobile self-scanning solutions. Successfully implemented at many leading European retailers, including Carrefour, Tesco and COOP Switzerland, our core solution My-Scan became the market leader for self-scanning. Our innovative solutions have a proven track record of helping large retail organizations build a stronger relationship with their customers, promote service-driven philosophy and increase customer loyalty and satisfaction.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/revision.png','Re-Vision','ISV','http://www.re-vision.nl',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rfid4u','RFID4U is a SBA 8(a) certified RFID software development and solutions company providing RFID Solutions, Consulting, Training and Services working globally with commercial and government organizations. RFID4U products and services improve business processes where identification, authentication and automation are of key concerns. RFID4U adds value to the organizations by way of improved labor efficiency, better inventory management across the supply chain, improved product integrity and reduced shrinkage. Clients include DHS, DLA, NSA, NIST, NIH, Bureau of Census, Northrop Grumman, Unisys, Harris Corporation, Lockheed Martin, IBM, HP, Dole Foods and many others.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rfid4u.png','RFID4U','ISV','http://www.rfid4u.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rlink','Soluciones Tecnolgicas  R-Link es una empresa dedicada a desarrollar soluciones tecnolgicas, especialmente en productos para telesupervisin, telemetra, logstica y control. Cuenta con la infraestructura y capital humano necesarios para la realizacin de productos de alta calidad. Con fuerte presencia en Latinoamrica y Caribe en soluciones de software de comunicaciones. Adems realizamos desarrollos a medida para cumplir con las necesidades de nuestros clientes.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rlink.png','R-Link S.A.','ISV','http://www.rlink.com.ar ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rocit','ROC IT Solutions enables serialized label printing, receiving, shipping, returns, deactivation, aggregation and de-aggregation at all points in the supply chain, from manufacturers to wholesalers, distributors, and retailers. Through more accurate and efficient supply chain serialization, ROC IT Solutions helps companies protect revenues, combat counterfeiting and diversion, and ensure consumer safety.  ROC IT software enables supply chain serialization through intelligent edge data capture. Our solutions allow companies to capture and process data for serialized assets at the edge of the supply chain, where materials handling takes place. By reducing data capture errors and providing real-time decision making at the point of materials handling, our solutions enable serialized product tracking without bottlenecks or bandwidth issues.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rocit.png','ROC IT Solutions','ISV','http://www.rocitsolutions.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rose','Rose Development specializes in the development of custom applications and solutions involving WebApplications, Database Systems, Mobile Applications, Synchronization, Rental Systems, Ship Reservation and ticket sales systems. Applications are written in various languages, including Objective-C, C++, HTML, SQL, 4D, HTML, and JavaScript.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rose.png','Rose Development','ISV','http://www.rosedev.nl',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rothco','Rothco is a UK-based development house with over 15 years experience of developing bespoke applications including bar-coding applications and Windows mobile development. They work with clients in a number of vertical markets including transport and logistics, manufacturing and retail. Support and installation is offered in various countries by using LogMeIn Rescue remote interaction.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rothco.png','Rothco','ISV','http://www.rothco.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rpr','A specialist company dedicated to the design and manufacturing of high quality electronics.\nRichard Paul Russell Ltd design and manufacture SpaceLogger data loggers, a range of compact, affordable data recorders for a wide variety of applications.\nThe range includes options of a real-time clock with battery backup for time-stamping data, two RS232 ports, two 4-20mA channels and 2 digital I/O channels; Data is stored on an SD card and can be manually transferred or sent by Bluetooth or Wi-Fi. Low power consumption and high capacity data storage makes them ideal for remote data acquisition.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rpr.png','Richard Paul Russel (R-P-R)','ISV','http://www.r-p-r.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('rumbo','RUMBO SISTEMAS, is an independent software vendor (ISV) company specialist in developing Logistic Software, highlighting a warehouse management system (WMS) and on-site data collecting. We have experience in improving warehouse management, using our standard or customizable solutions of software.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/rumbo.png','Rumbo Sistemas','ISV','http://www.rumbosistemas.es',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('savant','Since 1987, Savant Software, Inc., based in Phoenix, Arizona, provides organizations looking for entry level (ADC) Automated Data Collection systems or an advanced (WMS) Warehouse Management System, with scalable supply chain solutions that grow as their business and operational requirements evolve. Every day, leading companies in industries like wholesale distribution, consumer goods, food and beverage, automotive, and pharma/life sciences, rely on Savant Software to optimize the efficiency of their supply chain. Savant works with customers to understand business processes, identify choke points, and implement real-world solutions to improve the profitability of distribution operations by minimizing risk, shortening implementations, and ensuring business objectives are met.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/savant.png','Savant WMS','ISV','http://www.savantwms.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('schoolworks','Schoolworks provide school and college management systems developed on the force.com cloud platform. Features include enquiries, registrations and enrolments, document management, finance, scheduling, attendance, compliance, reporting, student, teacher and parent community portals and student ID card systems. Our offices are based in Hammersmith, London, and we have clients located in the UK, Europe and Australasia. ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/schoolworks.png','Schoolworks','ISV','http://www.schoolworks.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('seagull','Seagull Scientific is the developer of BarTender -- an award-winning software program for designing and printing labels, barcodes, plastic cards and RFID tags. Four editions address a wide range of requirements, including support for the most advanced label standards and smart card encoding. BarTender runs stand-alone or integrated with major ERP applications from Oracle, SAP, IBM and others. Seagull is also the worlds largest developer of Windows drivers for industrial printers. BarTender and Drivers by Seagull are translated into over 20 languages. Visit Seagulls website to download a 30 day full-working Trial Edition.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/seagull.png','Seagull Scientific','ISV','http://www.seagullscientific.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('seeonic','Seeonic is a leading provider of in-store Actionable Intelligence systems delivering real-time business information driving sophisticated and effective action in the management and replenishment of in-store inventory, resulting in reducing stock-outs and increased revenues for manufacturers and retailers. Manufacturers, and retailers gain competitive advantages through our combined SightWare and Seeniq business intelligence offering. Our intelligent data service features item-level accuracy and provides real-time visibility to in-stock inventory. Utilizing the data gathered, real-time alerts are generated and predictive modeling algorithms are applied to initiate replenishment action thus increasing return on sales and store investments. This web accessible data originates within our SightWare system in the display and transmits information to our Seeniq data portal via a wireless uplink.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/seeonic.png','Seeonic, Inc.','ISV','http://www.seeonic.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('seltris','Seltris was established in 2001 and is involved in information technology and telecommunications, with a core business dedicated to information management solutions for product traceability, warehouse logistics, and the control and planning of maintenance coordination distribution software. The company is based in Italy on the border of the provinces of Brescia, Mantua and Cremona.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/seltris.png','Seltris','ISV','http://www.seltris.eu',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('senecore','Senecore provides unique solutions for business mobility. With server and device apps like, BrowserPrint(tm), we bring powerful printing capabilities to smartphones, tablets, and other popular mobile computers. ','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/senecore.png','Senecore','ISV','http://www.senecore.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('sequent','eQent provides a hardware/software bridge from Alarms & Events that occur in plant floor equipment and applications and sends Real-Time information to Blackberry\'s, cell phones, pagers, Motorola TEAM ES400 devices, MOTOTRBO two-way radios, Motorola mobile computers, LED/LCD displays and audible outputs. This information enables hourly and salaried staff to make better informed decisions that impact productivity, quality and the bottom line.Our customers include some of the largest discrete and process manufacturers in the world such as; Abbott Nutrition, Chrysler, Ford Motor Company, General Motors, Georgia Pacific, Honda, Intel, Kellogg\'s, Magna, P&G, SC Johnson, Toyota and WS Packaging.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/seqent.png','Seqent','ISV','http://www.seqent.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('silvergreens','SilverGreens offer retail solutions which include centralized stock control, ordering, pricing and sales rights. Their hospitality solutions include access control combined with a wallet function, allowing members to add cash to their membership cards. This can also be integrated with a centralised inventory control. SilverGreens cover Sub-Sahara Africa operating out of Nairobi, Kenya.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/silver-greens.png','Silver Greens Ltd','ISV','http://www.silvergreensltd.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('sko','SKO Systems is a global provider of innovative software products, solutions and services across industries. SKO Systems solutions enable to meet mainstream, niche and individual market segment requirements. We innovate and develop IT applications and support services across every aspect of the business.\nAt SKO Systems, we bring together technology and engineering to provide innovative solutions for our customers in a wide range of industries. Our unique business model is built around relationships. To our customer, our Relationship is all about commitment, attention, flexibility and top-to-bottom undiluted share of mind. We align ourselves completely with our global customers to accelerate the value creation process.\nFurthermore, SKO has and continues to establish successful relationships and strategic partnerships with our customers.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/skosystems.png','SKO Systems','ISV','http://www.skosystems.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('smartvolution','At Smart Volution we are passionate about mobile technology. We has been delivering mission critical mobile computing applications to enterprise businesses for over 10 years, on rugged, semi rugged and consumer handheld and tablet devices. Our applications are delivered cross platform on Apple iOS, Android and Windows Mobile all backed by solid industry partnerships. Over the years we have become mobile experts over many verticals and our specialisms include retail, market research and general field service enterprise mobile computing applications. Smart Volution has in depth experience in mobile EMV payment device integration.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/smart-volution.png','SmartVolution','ISV','http://www.smartvolution.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('softgen','SOFTGEN S.A.S S.I.M.B.A.D. es una suite completa de software que cubre todo el ciclo de entrada y salida de informacin de la compaa desde el diseo y la creacin de los productos ,los costos, la planeacin de la produccin,los pedidos, el corte, la confeccin, los procesos de terminacin, los despachos, maneja 3 Mensajes EDI ORDER, AVISO DE DEPACHO, PRICAT,las ventas, las compras, la cartera, las cuentas por pagar y las cuentas por cobrar y el punto de ventas. SOFTGEN S.A.S Una compaa dedicada a desarrollar aplicaciones sobre medida para mercados verticales, especialmente para la industria de la manufactura y la confeccin textil.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/softgen.png','SoftGen S.A.S','ISV','http://www.softgen.co ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('sologlobe','Since 1997, Sologlobe has been developing and implementing their best-of-breed supply chain optimization systems. SOLOCHAIN is a world class Warehouse Management System (WMS) and Manufacturing Execution System (MES), with implementation sites spanning the globe. This solution allows manufacturing as well as logistics companies to optimise their operations across the supply chain. SOLOCHAIN is a web-based application that provides a scalable and easily adaptable platform, that integrates the latest technologies. Fast, intuitive user interfaces translate into better control, increased mobility and a more productive work force.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/sologlobe.png','Sologlobe','ISV','http://www.sologlobe.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('soluciones3f','Como la tecnologa nos apasiona, hemos concetrado nuestro foco en aplicaciones web distribuidas (para intranet o en la \"nube\"), dispositivos mviles y desarrollo de video juegos (una variante que ha recibido mucha atencin en estos ltimos aos).  Desde que 3f fue creada, mantuvimos un objetivo principal: vivir de lo que nos apasiona. Siguiendo ese instinto nos comprometemos con los clientes para darles lo que necesitan: soluciones. Trabajamos en equipo.  Creemos en que todo es un aprendizaje, que estamos siempre creciendo y mejorando. As es como durante todos estos aos 3f se convirti en una empresa destacada por la calidad de sus servicios.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/soluciones3f.png','Soluciones 3f','ISV','http://www.soluciones3f.com.ar ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('soti','Inc. develops industry-leading technology that solves the unique challenges involved in deploying, managing, securing and supporting remote mobile and desktop computing devices. Over 80,000 customers around the world in retail, manufacturing, health care, government, logistics and other industries rely on SOTI products to reduce the costs associated with supporting a mobile field-force.  SOTI is truly international with offices in Canada, the US, Australia and the UK, deployments in over 150 countries as well as products and support available in English, French, Japanese, German, Korean and Spanish. In 2010, SOTI won numerous Awards including the 2010 Microsoft Worldwide Mobility Solution Partner of the Year Award and the 2010 Microsoft Impact Mobility Solution of the Year Award.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/soti.png','SOTI Inc','ISV','http://www.soti.net ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('spacetec','SpaceTec is the leading UK supplier of IBM System i software solutions for Output Management, Electronic Document Handling, Web Development and Enhanced Security.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/spacetec.png','Spacetec','ISV','http://www.spacetec.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('springwireless','Spring Wireless  a lder mundial em solues para mobile business, servindo mais de 450 grandes clientes, com mais de 1,5M usurios mveis em 30 pases. Suas solues permitem as empresas conexo continua entre a fora de venda em campo e os sistemas corporativos, tornando disponveis as informaes de negcio relevantes e transaes quando necessrias. Spring Wireless atua como nico ponto de contato para seus clientes, entregando e gerenciando, ponta a ponta, solues mveis que englobam software, infra-estrutura, conectividade e servios. Essa abordagem maximiza o valor de negcio atravs do aumento dos nveis de servio, da reduo do custo total de propriedade (TCO) e de parcerias de longo prazo com nossos clientes. Fundada no Brasil, a Spring Wireless vem crescendo constantemente e expandindo suas operaes internacionalmente atravs de escritrios na Amrica Latina, Estados Unidos, Europa e Rssia.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/spring.png','Spring Wireless','ISV','http://www.springwireless.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('starmount','Starmount software solutions bring the richness of the Web and the power of mobile into the store. Specifically designed to equip sales associates with richer information to serve customers, Starmounts mobile selling solutions help retailers deliver a more personalized, efficient interaction from point-of-interest to point-of-sale. Additionally, Starmount extends the value of our customers enterprise and store systems through integration and implementation of point-of-service applications. Headquartered in Austin, Texas, Starmount works with a diverse client base of global retailers such as Pep Boys, Urban Outfitters, and Home Depot.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/starmount.png','Starmount','ISV','http://www.starmountsystems.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('stclair','Over the past 29 years, St. Clair Interactive has been a leader in the kiosk and self-service industry. St. Clair provides award winning self-service solutions across multiple verticals and devices. Intuitive user interfaces, robust management solutions, and an unparalleled amount of experience understanding customer behavior are our focus, providing solutions to improve and streamline a user experience.  From completely custom solutions to template applications, St. Clair\'s experience lends itself to rapid deployments of a proven framework, allowing for simple but powerful benefits to be quickly deployed and measured for success.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/stclair.png','St. Clair Interactive','ISV','http://www.stclairinteractive.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('stealthid','StealthID Solutions provides inventory accuracy to improve top and bottom line sales. As a pioneering, client centered and mission driven company, we implement solutions to promote organizational performance, deliver measurable results and offer added value to clients. This is accomplished through significantly increasing asset visibility using EPC enabled RFID. Such results can be demonstrated by looking at StealthID Solutions\' consistently successful approaches to the costs and complexities faced by companies and organizations when creating better visibility of their assets. At StealthID Solutions, we pride ourselves on our ability to apply the advancing technology of RFID in a strategic, business conscious method.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/stealthid.png','StealthID Solutions','ISV','http://www.stealthidsolutions.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('stemsoft','Created by STEMSOFT Software, the leading provider of cellular therapy software solutions, StemLab is designed to manage and streamline the unique workflow followed in the cell therapy and cord blood bank laboratory. StemLab(tm) is built to ensure quality and accreditation compliance standards are met by establishing procedural protocols, documenting lot-to-lot traceability and automating the generation of the ISBT 128 identifiers and labels for all of your products. Imagine having one complete solution to track all of your unique product and operational information to help save time, save money and increase your access to a full dataset for complete analysis - contact STEMSOFT today to find out more.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/stemsoft.png','Stemsoft','ISV','http://www.stemsoft.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('stepup','From the beginning the partners of STEP UP Systems Group have specialized in designing, developing and implementing output solutions for SAP. A natural extension of this output development includes the creation of documents which utilize Zebra technology and hardware.  STEP UPs technical experts work with SAPs output design tools (SAPscript, Smart Forms and Adobe) to render efficient and effective print documents. From simple labels to complex shipping documents, STEP UP has the combined Zebra-SAP knowledge to assist.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/stepup.png','Step Up','ISV','http://www.susg.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('stratum','Stratum Global is an RFID Software Solutions company, and proud to be an ISV Partner of Zebra\'s. Companies who are looking to know where their stuff is and in what condition  from tools, to wheel chairs, to IT Assets, and/or looking to know where their people are  from patients to employees to students, all look confidently to Stratum to help them design a solution that is cost justifiable, easy to implement and built to scale. Our TagNet solutions are infinitely flexible. Our clients have found that our modular, Start Small. Think Big. approach resonates with them.\n','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/stratumglobal.png','Stratum Global','ISV','http://www.stratumglobal.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('sygic','As a specialized division of Sygic, the international leader in offline navigation and location based software, Sygic Business Solutions is focused on developing professional solutions for customers in fields of transportation, logistics, mobile workforce, automotive, utilities, emergency and communal services.  Sygic Business Solutions offers an advanced and highly customizable product portfolio based on Sygic turn-by-turn offline voice guided multiplatform solution. Every day Sygic navigates over 100 000 professional drivers in 115 countries. Sygic team consists of over 100 talented professionals, committed to developing innovative products and the company remains one the fastest growing IT companies in Europe, acknowledged be Delloite every year since 2007.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/sygic.png','Sygic','ISV','http://www.sygic.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('sysdev','SYSDEV is a software development company focusing on mobility. They design and implement applications that cover various indoor activities (Warehouse Management, Quality Control, etc.) and outdoor activities (Inquiries, Order Registry, Technical Incidents, etc.).\n\nTheir software solutions include a mobile application developer platform for Microsoft OS named Kalipso, which is constantly evolving and regularly updated with new functionalities and greater technology integration, allowing customers to increase their business value and go faster into market.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/sysdev.png','Sysdev','ISV','http://www.sysdevsolutions.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('take','TAKE Solutions is a global technology solutions and service provider, with significant focus across two principal business areas  Supply Chain Management and Life Sciences.  TAKEs supply chain group, formerly ClearOrbit, Inc., provides solutions that improve supply chain speed, visibility and control by automating internal processes and integrating trading partners to enable manufacturers and distributors to smoothly orchestrate the movement of goods through the extended supply network. TAKEs single data model approach extends the functionality of procurement, manufacturing, and warehousing systems from Oracle and SAP to eliminate supply chain, warehousing, data collection, and reverse logistics inefficiencies.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/take.png','TAKE Solutions','ISV','http://www.takesolutions.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('teklynx','TEKLYNX International is the world\'s leading developer of barcode labeling software solutions. Its products feature the widest range of device and driver support in the industry. TEKLYNX is a Microsoft Gold Certified Partner, Oracle Gold Partner and has connectivity relationships with multiple Enterprise Resource Planning (ERP) software providers. More than 600,000 companies in 120 countries rely on its integrated software solutions for supply chain automation, warehouse management, shipping and receiving, inventory control and asset management. TEKLYNX is headquartered in France with operations in the United States, Europe, Japan, China, and Singapore.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/teklynx.png','Teklynx','ISV','http://www.teklynx.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('teknopalas','Teknopalas offers turnkey projects intended to enhance the productivity of companies in the logistics, textile, food, AVI solutions and pharmaceutical industries. Teknopalas uses new generation technologies, with UHF RFID technology being the primary technology employed','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/teknopalas.png','Teknopalas','ISV','http://www.teknopalas.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('timsa','TIMSA, es una empresa mexicana con ms de 27 aos de experiencia en el desarrollo y comercializacin de soluciones en informtica para el sector salud. Empresa precursora en detectar las necesidades del Sector Salud, compuesta por un grupo de profesionales tanto del ramo de la informtica como del mdico. Soluciones en informtica para el Sector Salud.Ofrecemos sistemas para:  * Expediente Clnico Electrnico * Hospitales,Clnicas,Consultorios Mdicos,Banco de Sangre, Laboratorios Clnicos y Patologa.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/timsa.png','TIMSA','ISV','http://www.timsa.com.mx ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('titan','The primary focus of Titan Software is enabling mobile access to SAP business systems and processes. We provide a mobile interface to both SAP-delivered and custom programs. We also develop completely new mobile applications tailored to individual customer requirements. Our goal is to always provide High-Fidelity user experiences. In addition, Titan Software develops add-on components for SAP. We provide custom add-ons and extensions to enhance the standard SAP software suites to fulfill requirements that are not met by a standard solution. These extensions are appropriately integrated into the parent SAP components and support customer-specific configuration options following SAP standards.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/titansoftware.png','Titan Consulting ','ISV','http://www.titansoftware.mobi ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('tlantic','A Tlantic  uma empresa de software especializada em aplicaes de varejo, cuja tecnologia encontra-se aplicada em diversas empresas do setor. A Tlantic entende o software como um veculo para melhorar as operaes e a produtividade no varejo, motivar os colaboradores e qualificar a interao com os consumidores. Para atender esta aspirao, a Tlantic sustenta-se em princpios e valores fundamentais que vo desde o aspecto estratgico do seu posicionamento (transformar a necessidade do negcio em ativo atravs da TI), equipes com experincia em varejo, passando por processo de desenvolvimento de software abrangendo as melhores prticas, at valores pessoais como comprometimento, transparncia e foco em resultados','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/tlantic.png','Tlantic','ISV','http://www.tlantic.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('trackabout','TrackAbout is a scalable software-as-a-service (SaaS) solution to track, manage, maintain and optionally rent portable physical assets. Items are tagged using barcodes or RFID tags. Data is collected using rugged handheld scanners, smartphones, tablets or integration from other systems. Dynamic fields and forms may be easily added to support a companys unique workflows. TrackAbout integrates all of this information with existing enterprise systems. Founded in 2000, TrackAbout has evolved through an active relationship with our customer base which includes world-class organizations in eight countries.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/trackabout.png','Trackabout','ISV','http://www.trackabout.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('transart','Transart is a Romanian software company, specializing in Sales Force Automation, Business Intelligence, Warehouse Management Systems, and ERP for business management of SMBs. Transart is ISO 9001:2008 certified and has a number of multinational companies as customers across a number of verticals from FMCG to IT hardware to Pharmaceutical products.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/transart.png','Transart SRL','ISV','http://www.transart.ro/',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('twx','Founded in 1999, TWX is a leading Brazilian software company specialized in mobile printing solutions for logistics, retail, manufacturing and field service applications. Our applications offer barcoding and RFID technologies with complete software development and full professional services (installation, implementation, customization, training and maintenance). One of the most recognized and best-known software company in Brazil.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/twx.png','TWx','ISV','http://www.twx.com.br ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('tyreman','Tyreman has successfully provided leading technology software solutions to all sectors of the tyre and exhaust market for over twenty five years. The e-commerce (B2B & B2C) offers on-line trading with seamless integration into the Tyreman back office system. The hosted software solution is a popular option as it provides a low cost start-up solution. It incorporates an email/SMS service to allow documents to be delivered electronically. Tyreman were one of the first companies to embrace EDIwheel functionality, which provides the ability to communicate directly with manufacturers ERP systems allowing stock reordering to be done automatically, and the option for receiving and matching e-Invoices on the system.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/tyreman.png','Tyreman','ISV','http://www.tyreman.co.uk',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('uberall','Uberallcorp es una compaa de software dedicada a la optimizacin de los procesos productivos empresariales que se realizan fuera de la oficina. Mediante la utilizacin de dispositivos mviles inteligentes (smartphones y pdas) integrados con nuestra solucin, desarrollamos un nuevo y optimizado canal de comunicacin entre los recursos que realizan su actividad en el campo y los que planifican y controlan el mismo desde la oficina. Poseemos productos estandarizados para la optimizacin de Cobranzas, Instalaciones, Facturacion,Marketing, Logistica y Ventas. Nuestras aplicaciones son utilizadas en varios paises de Sudamrica por empresas como IBM, Philips, Total, Telecom Personal y Praxair entre otras.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/uberallcorp.png','Uberall Corporation S.A.','ISV','http://www.uberallcorp.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('unity5','Unity 5 is a System developer and integrator specialising in cloud based systems and mobile application development with iPhone and iPad.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/unity5.png','Unity5','ISV','http://www.unity5.com',0);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('velotree','VeloTree provides software and services for tree management. Our solutions are used by power companies, arborists, tree cutters, municipal, county and state governments and maple sugar operations to manage their tree inventory, cutting contracts, work orders and related issues.  GPS location data and digital photography help provide richer information while printed tickets provide a hard copy/paper backup of work.  The combination of data collection using mobile devices and web-based services is a vast improvement over traditional paper-based record keeping and workflow. It also serves to reduce duplication of effort, reduce error-prone data copying and streamlines invoicing, billing and auditing.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/velotree.png','Velotree','ISV','http://www.velotree.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('verisoft','Verisoft specializes in EMV, LOYALTY, PREPAID and GIFT CARD turn-key software solutions. The scope of solutions range from integrated back office issuing and acquiring of these card systems and front office transaction switching systems from EFT/POS terminals, ATMs, Kiosks, Mobile devices and Smart Phones. You can personalize cards with high speed printers centrally in batches or in branches or at points of service instantly. The cards can be personalized for smart EMV chip,contactless, magnetic stripe, barcode or QR codes. You can also graphically design the imageswhich will be personalized on these cards for customized cards.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/verisoft.png','Verisoft','ISV','http://www.verisoft.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('versatile','Versatile Security is a leading IT solutions provider in the identity and access management space with focus on easy deployment of smart cards with innovative smart card management systems. The companys customers are typically organizations that demand high security and ease of use. State of the art solutions enable the customers to securely authenticate, issue and manage user credentials, such as smart cards, more cost efficiently than other solutions on the market. Versatile Securitys mission is to provide solutions that are affordable and easy to integrate, thus allowing organizations of all sizes to implement high levels of security. First class support, maintenance, and training is also offered. Customers include: HSBC, Tieto, Centric, Raiffeisenbank, TradeRiver, European Commission, Svensk Exportkredit and IKEA.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/versatile.png','Versatile Security','ISV','http://www.versatilesecurity.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('vintelligent','VinTelligent, Inc. provides technology products and services for the transportation industry including mission-critical business analysis, application design and development, system integration, 24x7 technical support, and data center application hosting services. VinTelligent is leader in finished automobile logistics with the VinTelligent suite of products. These solutions, deployed at over 50 facilities manage finished vehicle transportation via truck, vessel, and rail. The VinTelligent application is web-based, modular and scalable, providing fast and easy customization based on individual customer\'s business requirements. The system improves yard, vessel, train, and truck utilization by seamlessly integrating internal and external systems. VinTelligent reduces manual input by maximizing the use of EDI and electronic scanning. VinTelligent software enables higher levels of operational efficiency, and increased profitability. Over the past two decades VinTelligent, Inc. has developed depth of experience providing best of breed solutions to the most demanding transportation companies.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/vintelligent.png','Vintelligent','ISV','http://www.vintelligent.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('visicom','Visicom is an innovative global provider of mobile software solutions for sales organizations (Sales Force Automation SFA) covering Presales, in both modern and traditional trade, Merchandising and Direct Store Delivery (DSD). As a result of our extensive technology portfolio and experience in developing, deploying and managing mission-critical business applications, our solution is currently used by thousands of field sales professionals around the world. We designed our core mobile technologies to enable rapid deployment of standard-based mobile solutions for different vertical segments. We offer the highest quality level to our over than 10,000 users in more than 30 countries across the world.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/visicom.png','Visicom a.s.','ISV','http://www.visicom.com',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('vistadata','Vista Data Systems provides software for the AUTO ID Industry including Inventory Control, WMS, Asset Control, Warehouse Distribution and Back Office Retail Applications. Our software using the Microsoft platform has grown throughout the years with capabilities and features. Now we are moving to mobile applications and cloud based solutions. With our background, experience and software investments we are able to bring to organizations of any size a cost justifiable solution.  Why choose Vista as your software provider, experience (since 1979), proven software tool sets, an installed base with diverse applications, investment in new products and platforms plus our commitment to make every installation a success.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/vista.png','Vista Data Systems','ISV','http://www.vistadata.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('wavelink','With more than 7.5 million active client licenses in the field, Wavelink is the leading provider of multi-vendor mobile device management, wireless infrastructure management, terminal emulation, voice enabling, proactive telecom expense management and mobile application development software. Wavelink technology solves the unique challenges involved in deploying, managing and controlling today\'s enterprise mobility systems, and facilitates peak performance from frontline staff. More than 15,000 companies in the retail, manufacturing, government and logistics industries rely on Wavelink to accelerate application delivery, reduce device management and support costs, and tighten network security. Inside the four walls, or in the field, Wavelink leads mobility.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/wavelink.png','Wavelink','ISV','http://www.wavelink.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('whitepeaks','White Peaks Technologies assists the hospitality industry by providing efficient, effective, and easy to use enterprise applications that have a quick return on your investment. Some software offerings are: point of sale systems, property management systems, ticketing solutions, and golf course management systems. Each system is available as-is or can be customized to fit your properties unique needs. These applications can be used independently or can communicate together to provide one centralized database for easy management and reporting. Systems also integrate with a wide variety of printers, scanners, and other devices.  PCI Compliant payment processing solutions are also available.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/whitepeaks.png','White Peaks Technologies','ISV','http://www.whitepeakstechnologies.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('x10data','Empower Your Entire Mobile Workforce with role-tailored, mobile line-of-business solutions for Microsoft Dynamics. Our x10DATA Mobile solution suite enables warehouse and field task workers to collaborate real-time at the point of activity using handheld computers and Zebra mobile printers. Clipboards and phone calls are replaced with streamlined data collection and accurate information available on-demand, maximizing productivity and customer satisfaction. Inventory, sales, service and project data are seamlessly integrated to Microsoft Dynamics enabling more informed business decisions and financial control.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/x10data.png','x10DATA, Inc.','ISV','http://www.x10data.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('zcura','Zcura provides hospitals with Physician Preference (PPI) track & trace solutions that increase patient safety, improve clinician efficiency and reduce supply costs, while insuring FDA Recall traceability and Joint Commission compliance. Zcura provides a chain of custody for bone, tissue and implant procedures, letting clinicians know what supplier an item came from, the refrigerator and temperature it was stored at, or the date it expires before implanting it to a patient. Additionally, Zcura provides supplier reps and material technicians with the ability to control inventory with mobile devices, scanning bar codes or RFID tags for picking, put away, reordering and location tracking; while administrators negotiate better contracts with Zcuras vendor performance and patient utilization data.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/zcura.png','Zcura','ISV','http://www.zcura.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('zspace','Z-Space is a full service software development company specializing in mobile data collection applications. Using our ITScriptNet(r) development software we design custom applications for virtually any data collection need. Many of our applications include Bluetooth and 802.11 mobile or desktop printing with Zebra printers. Z-Space also offers \'Solution Packs\' which are turn-key solutions that include a SQL database, reports, PC application and a mobile data collection program for Asset Tracking, Check In/Out, Inventory Management, Direct Store Delivery and a web-based Package Delivery system. We have expertise with RFID, GPS, Visual Studio, integration with Quickbooks, label design & printing, web site development, and batch, WiFi & GPRS communications.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/zspace.png','Z-Space','ISV','http://www.shiprush.com ',1);
INSERT INTO `partner` (`id`, `description`, `logo`, `name`, `type`, `url`, `validated`) VALUES ('zync','Zync-Solutions provide leading cloud based hosted data capture and reporting solutions for the mobile workforce. Zync-Solutions specialise in the Field Marketing, Field Sales and Market Research industries and their applications are used by many of the top businesses and agencies to support their mission critical services.','http://www.zebra.com/content/dam/zebra/logos-icons/isv-partners/zync.png','Zync Solutions','ISV','http://www.zync-solutions.co.uk',0);
